INSERT INTO `places` VALUES ('02d9a2b5-7dca-423f-8406-707bc76abf7e','2017-03-25 02:17:06','2017-03-25 02:17:06','1721b75c-e0b2-46ae-8dd2-f86b62fb46e6','3ea61b06-e22a-459b-bb96-d900fb8f843a','The Lynn House','Our place is 2 blocks from Vista Park (Farmer\'s Market), Historic Warren Ballpark, and about 2 miles from Old Bisbee where there is shopping, dining, and site seeing. We offer continental breakfast. You get the quiet life with great mountain and garden views. This is a 100+ year old cozy home which has been on both the Garden and Home tours. You have access to whole house, except for 1 restricted area (She-Shack).  Hosts are on site in a casita in the back from 8pm until 7am when we are in town.<BR /><BR />Our home has two bedrooms, one king and one queen.  There are 2 bathrooms, 1  1950\'s soak tub with shower and 1 with shower only.  Guests have access to the living/dining room area, and the kitchen (except for use of stove/oven).  Each morning, coffee/tea, and muffins are ready for guests.  A small frig is available in the dining room with water/juice and an area for guest items.  1 parking space is directly across the street.  There is a large back patio with a grill for guests to u',2,2,4,82,31.4141,-109.879),('0675a2d6-f64c-4be7-9a8a-f55341f09d4b','2017-03-25 02:17:06','2017-03-25 02:17:06','4a0c57bb-60da-450c-afcf-c59be4c05e67','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Cozy, Bright Studio in GOLD COAST w/Rooftop','This lovely, sunny studio is in the beautiful Gold Coast neighborhood of downtown Chicago. Bars, restaurants, parks, shopping and public transport are within walking distance. Steps away from the Loop. Prime nearby attractions include Lake Michigan, Oak Street Beach, Lincoln Park, Museum of Contemporary Art and the Lyric Opera. Rush Street, which offers great dinning, shopping and entertainment, is a short block away.<BR /><BR />Apartment has shared rooftop with beautiful views of Chicago\'s skyline.<BR /><BR />This 250 sq. ft. studio is cozy, warm, and with lots of light. The small kitchen has a stove, a microwave, a toaster, and an espresso machine loaded with good coffee. Our apartment has a queen-sized mattress, and two-person sofa: altogether they can accommodate three persons. Plenty of closet space.<BR /><BR />You will have an access to a shared rooftop, and a laundry room. Free street parking is available very close to the building on LaSalle Street (except 4PM - 6:30 PM on week',0,1,2,65,41.9009,-87.6298),('073084e1-1d9d-49e6-8383-42ef6f4325b5','2017-03-25 02:17:06','2017-03-25 02:17:06','f3923bdf-81f2-45e9-a5e1-fd128e122d45','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Fairpark. Downtown Tupelo','A private bedroom with a queen size bed and private bathroom is available in my 3 bedroom home in Tupelo\'s Downtown Fairpark. Access to Living area, laundry and kitchen included. One block from downtown shopping, restaurants, BancorpSouth Arena and the Farmer\'s Market. This is a friendly and quiet neighborhood. There are 2 bedrooms available for up to 4 guests.<BR /><BR />Parking is available at house. One block from downtown tupelo, Lots of restaurants, shopping and entertainment within 1 block of house.',1,1,2,54,34.2546,-88.7022),('09b4888f-0e06-4ab1-abbc-05e9865634d0','2017-03-25 02:17:06','2017-03-25 02:17:06','e4e40a6e-59ff-4b4f-ab72-d6d100201588','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Spanish Town Historic District, Heart of Downtown','Our home is a block away from parks, art and culture, including several museums and the Capitol district,  and restaurants and bars within walking distance. Very safe, quiet, in the bustle of downtown but the privacy of a neighborhood. The location, the people, and the ambiance of our funky neighborhood, Spanish Town, make this a perfect spot when visiting. My place is perfect for couples, solo adventurers, business travelers, and pets.',1,1,2,65,30.4557,-91.1827),('0a454f9a-eaac-488b-8443-23cf58f7ae37','2017-03-25 02:17:06','2017-03-25 02:17:06','5e061866-d4ad-4aa7-befe-2bf5f8698e29','f9b11370-f316-492c-92da-014d7bce7213','Beautiful, Bungalow steps to Beach!','Looking for a cozy, beach house? Well this is it!<BR />Steps from the most beautiful beachs.<BR />Shared home with 2 cool roommates.<BR />Comfy corner bedroom with a full bed & amazing sea breezes.<BR />Cable, WiFi, plenty of yard for parking a car or hanging out!<BR />House is 30 minutes by car from airport, Honolulu & Waikiki.<BR />It\'s BEST to rent a car if staying here, especially if you don\'t want to spend a large amount of your time getting places.<BR /><BR />The house has a great vibe that invites you in to hangout.<BR />It\'s a 3 bedroom 1 bath home.<BR />Steps from Kailua beach.<BR />Two people currently live in the house but are not always home. <BR />Very friendly, Ohana style.<BR />Kitchen to make coffee & very light food prep & living room  are available for your use.<BR />Make yourself at home. <BR />There is TV, Cable, Wifi.<BR />Small workout area outside if you like to lift weights.<BR />Large yard for hanging out also.<BR /><BR />Rented room, family room, kitchen, bath',1,1,2,79,21.4088,-157.745),('0b96262f-2c72-464c-a182-8f58afde4288','2017-03-25 02:17:06','2017-03-25 02:17:06','45903748-fa39-4cd0-8a0b-c62bfe471702','b6160096-c503-4909-a674-7bfbddc8cc45','Freetown Artist Loft','The Freetown Artist Studio is situated  in the heart of  Downtown Lafayette and is only a few blocks from live music and great food. Living space is approximately 1000 square feet and comes with all of the amenities for a creative, relaxing getaway.<BR /><BR />The apartment measures 1000 square feet and has been newly renovated.  I\'m using this space strictly for airbnb. There are a total of 5 rooms, a dining room/utility room has table and chairs, serving utensils and artwork with folding doors hide the washing machine and dryer. The kitchen is complete with refrigerator, cast iron sink, dishwasher, cooking utensils  and gas stove. The bathroom has a cast iron tub/shower, toilet sink, towels and toiletries. The living room has a large picture window overlooking a pond, a sleeper sofa, media armoire, bookshelves, table and chairs and secretary. The bedroom has a queen size bed, chest of drawers, ceiling fan and closet. The apartment has many pieces of original art and small, private ba',1,1,4,100,30.2216,-92.0143),('0d10682b-5bd4-4fde-9427-0067fe6ff63c','2017-03-25 02:17:06','2017-03-25 02:17:06','f14fefb3-c6e4-42f6-8a5a-ee704a101f8b','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Large, sunny room','This is a large room on the second floor of a 1925 two-story house. With 5 large windows, it faces southwest and gets a lot of afternoon sun; the room has an air-conditioning unit in the summer, though the house itself is not air-conditioned. There is a queen-sized bed and a single bed in the room, and there is also a table and chair and lamp for lap-top work. The bathroom has a shower and is usually shared with other guests.<BR /><BR />This is a larger older house (1925) in a residential neighborhood on Red Mountain. The house has two living rooms that are fairly large and a front and back porch, a fairly big kitchen and a back room with a washer and dryer.<BR /><BR />Guests are welcome to use the living rooms. They are welcome as well to use the kitchen (and washing machine for longer stays), but we would appreciate it if you would let us know in advance your wishes for using the kitchen so we can coordinate.<BR /><BR />We will be around the house during guest stays, and we are glad ',1,1,3,36,33.4884,-86.8079),('0feb3595-1c64-4bad-816c-769446217d4f','2017-03-25 02:17:06','2017-03-25 02:17:06','14e49d0b-7363-40e3-8854-a89e96481f67','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Sugar Creek Hills','My place is close to Chicagoland speedway, public transport. Youll love my place because of the comfy bed and the coziness. My place is good for couples, business travelers, families (with kids), and furry friends (pets).Broker owned. no garage or basement use.can go month to month or year lease.<BR /><BR />Walk around the pond nearby or trail for exercise or just fresh air.<BR /><BR />entire home and yard<BR /><BR />Available by phone<BR /><BR />near metra,major highways',2,1,4,100,41.4921,-88.069),('1014dfdf-fa7a-487c-bba8-2d3076d570dc','2017-03-25 02:17:06','2017-03-25 02:17:06','5481bd82-04ab-4a58-ae01-d67443aec20c','70b18dcc-08ef-4040-91cf-4075973d320a','Private Studio with Mini Kitchen and Sauna','Private walk-out studio off beautiful backyard with mini kitchen, sauna, jetted tub, fireplace and your own laundry facilities. In the heart of the city, we are close to bus routes, National Jewish Hospital, Rose Medical Center and Cherry Creek Shopping District. An easy three miles west to downtown.<BR /><BR />It is cozy and yet has a number of creature comforts, including a Casper mattress (No. 1 rated by Consumer Report), a great soaking tub, an indoor sauna, heated tile floor in bathroom, fireplace, and a rain shower type shower head.<BR /><BR />The space is very self-contained, with its own private entrance, laundry facilities, bathroom, kitchen, outside sitting area and more, but guests can make use of the large backyard, deck, and additional sitting area.<BR /><BR />I really enjoy interacting with people but realize each guest will have his or her own natural preferences in that regard or priorities based upon the purpose of the trip. I am able to run the gamut from remaining av',0,1,2,75,39.7362,-104.929),('10974581-bff8-4ba6-9a00-2ae42d521162','2017-03-25 02:17:06','2017-03-25 02:17:06','dacec983-cec4-4f68-bd7f-af9068a305f5','426624f6-84a9-4ec4-84f3-7655dc70e86e','SOBE Refined Studio 2 min to Beach & Ocean Drive','Enjoy South Beach in one of the best locations in my clean, quiet & remodeled studio!<BR /><BR />You\'re only 2 blocks from the beach and 1 block from fashionable retailers, restaurants, bars, convenience stores, bike rentals & parking structure! <BR /><BR />FREE WiFi!<BR /><BR />My place is close to News Cafe, Wet Willie\'s, Otentic Fresh Food Restaurant, Cafe Del Mar, and Larios on the Beach. My place is good for couples and solo adventurers.<BR /><BR />My condo is permitted under a condo hotel license available at check in.<BR /><BR />Enjoy the convenience of a great location in a clean and quiet updated studio! The building is no frills, but you can\'t beat the location for the price. It\'s located on the calm side of a hotel - which also means you get access to a 24 hours front desk ( say you lost your key at the beach...).<BR /><BR />It\'s just been tastefully renovated too! While it is 270 sqft, you can comfortably enjoy a luxurious queen size bed ( 3 inch memory foam topper mattress',0,1,2,89,25.7778,-80.1327),('12ff7d06-9910-41cd-9eee-bdc21476d119','2017-03-25 02:17:06','2017-03-25 02:17:06','79ff14a4-1888-4cd3-8a31-230fa34bfa00','7231eaa1-400f-4cb5-a867-f5eba8adbb81','#Private Studio - Waikiki Dream','At beginning Waikiki, the tourist center of Honolulu, this charming studio is about 10min walking distance from the beach, and all happenings.  Across the bridge to Convention Center and 15min walk to Ala Moana mall. Bus line is across the street.<BR />Studio is fully furnished - full size bed,TV, Wifi, mid size fridge, full bath, microwave, coffee maker, induction hot plate. Building has laundry, pool, jacuzzi and BBQ area; for additional fee you may use gym and parking ($25/24hrs in-out privileges)<BR /><BR />Perfect location. Designed to be lived in on long term, this studio is suitable for long and short stays. Ocean view. Walking distance to the beach,  restaurants, shops, <BR /><BR />Pool, hot tub, BBQ area, W+D in the building; for extra fee gym and parking ($25/24hrs in/out privileges). There is also a convenience store, food place, King\'s Pub, hair salon, and smart car rentals in the building.<BR /><BR />at check-in and check-out<BR /><BR />Studio is located at the edge of Wa',0,1,2,119,21.2874,-157.834),('1385324e-d727-475c-ad30-f7dcb5afea02','2017-03-25 02:17:06','2017-03-25 02:17:06','1aef765c-3c91-47aa-a716-ffd3b8d748df','61302be9-4b31-4be0-92fc-d0dda253e167','1 Bedroom, 1 bath guest house','Fully furnished.  Just bring personal items.  Very quiet location. Living room, kitchen, bath and bedroom. Refrigerator, stove, microwave, coffee maker, 65\" TV  all Dish Network stations. 2 miles from downtown Globe.  Safe for walking.   Base of Pinal Mts. which are great for hiking.  8 miles from Apache Gold Casino.  20 miles from the Apache Nation at San Carlos, AZ and San Carlos Lake.  31.7 miles from Roosevelt Lake Marina.  29 miles to Tonto National Monument. 2 miles to Besh-Ba-Gowah Ruins.<BR /><BR />Guest will have access to the entire guest house.  They will be the only guest who will be there during their stay.  The space is a living room and kitchen, a bath and bedroom separated from the living room and kitchen. There is an excellent air conditioning and ceiling fans in the living room, kitchen and bedroom for added comfort. 65\" TV with all sports, movie, local stations provided by Dish Network. There is a desk in the living room for ease of computer use.  The bedroom has a',1,1,2,59,33.3678,-110.77),('14e9cb05-e188-4e02-ab2c-8ef425e5ea64','2017-03-25 02:17:06','2017-03-25 02:17:06','36bff3a3-e3b3-41b9-a6b5-ab2185a8cdf0','f9b11370-f316-492c-92da-014d7bce7213','A Room With a View','Charming private room, located in Minnesota\'s beautiful Capitol city. On bus line w/ access to light rail, easy transit. Coffee shops, and restaurants within walking distance. Travel professionals welcome! I\'ll create your home away from home.<BR /><BR />Located in a historic neighborhood full of colorful Victorian charm, you\'ll have plenty of options for creative backdrops when you take selfies on your evening stroll.<BR /><BR />You will have access to the full house. 2 levels - feel free to make yourself at home. WiFi, Netflix, full cable package available.<BR /><BR />If you need directions, recommendations, or to catch up on your favorite TV shows OnDemand, I\'m happy to help!<BR /><BR />My home is close to the city, but located on a large park so it feels like you\'re in the country. There are restaurants, coffee shops and even a healthy/organic grocery store all within a block or two.<BR /><BR />The bus line, with access to light rail, is a block from my front door. You can get to t',1,2,2,50,44.9606,-93.0715),('18ff54e2-dc10-4e7f-bfdb-8a7591f7f009','2017-03-25 02:17:06','2017-03-25 02:17:06','45903748-fa39-4cd0-8a0b-c62bfe471702','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Heart of Lafayette','This cozy private bedroom is located in the hottest spot in Lafayette. Right on University Avenue you are less than a mile from downtown, local eateries, and the University of Louisiana at Lafayette.<BR /><BR />You will have access to a shared full bathroom ( no tub ), a full sized kitchen, washer and dryer. You are welcome to sit on the front porch too.<BR /><BR />I am an Uber driver and I have my own lawn service. I\'m usually running the roads. But when I do see you, I enjoy nice talks and learning about where you are from.<BR /><BR />I love this location because my neighbors are extremely friendly and always more than willing to help.<BR /><BR />Uber is your best bet for transit in Lafayette if you have no vehicle. If you are looking to rent a local vehicle, please visit Turo. Or you can call me and we will figure it out.',1,1,3,35,30.2135,-92.0149),('19ae5055-f503-499d-a64f-2bf7d92eff5b','2017-03-25 02:17:06','2017-03-25 02:17:06','5481bd82-04ab-4a58-ae01-d67443aec20c','3ea61b06-e22a-459b-bb96-d900fb8f843a','Sunny 3rd Floor Corner Apt. No fees','Welcome to Capital Hill!!  Youll love the hip neighborhood, the comfy bed, the big couch, and the full kitchen.  This is a very quiet 3rd floor corner apt with one parking spot just outside!!! Fresh roasted craft coffee and continental style breakfast included.  My place is excellent for couples, or solo adventurers, and its Dog friendly too!<BR /><BR />The cozy 3rd floor unit comfortably sleeps two, but there is a 7 foot Room&Board couch that is a good option for a 3rd guest.  The bedroom has a full size deep memory foam mattress.   My home has both a full bathroom and large kitchen perfect for cooking meals.<BR /><BR />The entire place is yours.  The wifi,tv, kitchen, parking spot, and basement laundry are accessible.  An 88 key Digital piano with plenty of songbooks is there for the musical type.  I roast my own coffee so try some!  I try to keep the fridge stocked with some yogurt and fruit.  Help yourself.<BR /><BR />The entire space is yours. I respect your privacy and trust tha',1,1,2,80,39.7359,-104.975),('1ff1963c-7afa-470c-bc05-562b01549b09','2017-03-25 02:17:06','2017-03-25 02:17:06','d96b80e3-2c05-4fb6-922e-36643005a530','b6160096-c503-4909-a674-7bfbddc8cc45','Downtown Napa/Oxbow Area VR16-0054','Charming Bungalow attached guest suite with private entrance in desirable  neighborhood. Near downtown and Oxbow (1 mile). Easy access to 29 and Silverado trail wineries. 15 min to Yountville. <BR />This is a permitted vacation rental in Napa - meaning your reservation will not be cancelled by the Host for issues with the City of Napa!!<BR /><BR />Experience Napa at our quaint attached guest suite with private entrance -  1 bedroom, separate kitchenette and living space, bathroom and access to back patio. We also include 2 bikes with this rental. This home is in near downtown Napa and Oxbow. Walking/ Biking distance to Oxbow, restaurants, gourmet eateries, tasting rooms, wineries, etc. <BR /><BR />- Close to Silverado Trail for easy access to wineries such as Mumm, Frogs\' Leap, Luna, Pine Ridge, Contessa, Regusci, etc.<BR /><BR />- 15 minute drive to Yountville for world class restaurants such as Bouchon, Bottega, French Laundry, Ad Hoc, Redd Wood, R+D, and Lucy. <BR /><BR />-Sleeps 2 ',1,1,4,184,38.3131,-122.271),('207f5bf6-d1de-4cca-a60d-c2c48e93debc','2017-03-25 02:17:06','2017-03-25 02:17:06','c49639ab-d287-40ec-8a31-76b493cd9a3a','f33e2624-520b-4bc2-b6a0-190ee1d41855','Halford House at KateGriffin','My 1896 circa house is a short walk to the MSU Riley Center, a fully-restored 1889 grand opera house that this season will host Wynton Marsalis, Vince Gill, Melissa Etheridge and others, and is close to restaurants, museums, historic churches and daily passenger trains running from New Orleans to Atlanta to New York. Youll love my place with its 13\' ceilings, beveled glass, parkay floors, vintage mantels, and historic neighborhood easily accessible to Interstates 20 and 59.',1,1,3,89,32.3633,-88.7072),('279b355e-ff9a-4b85-8114-6db7ad2a4cd2','2017-03-25 02:17:06','2017-03-25 02:17:06','1da255c0-f023-4779-8134-2b1b40f87683','8394fd35-8a8a-479f-a398-48f53b4a6554','Guest House by Tulane','The guest house is located uptown two blocks from Tulane U. The house is located in a very safe and convenient location. The house has a private entrance and patio space. The house also has access to a large backyard with a charcoal grill which is shared. This is a simple, clean and affordable place to stay while visiting New Orleans. We provide everything travelers need. Please contact me if you have any questions.<BR />Thanks,<BR />Ryan<BR /><BR />Note: We have a $50 pet fee',0,1,2,60,29.9493,-90.1171),('2b6e6650-5f69-426d-a084-71f7ad30d1f1','2017-03-25 02:17:06','2017-03-25 02:17:06','5e061866-d4ad-4aa7-befe-2bf5f8698e29','426624f6-84a9-4ec4-84f3-7655dc70e86e','Tranquility at Hale Kolea ','Walking distance to beautiful beach in Kailua. Hale Kolea is private and quiet in a tropical setting. Your own entrance with kitchenette, wooden floors, high ceilings, aircon in bedroom. True island paradise close to great restaurants and hiking trails.<BR /><BR />Almost 600 square feet of space, the unit is attached to the main house but very private since the living quarters are on opposite sides of the property.<BR /><BR />Guests may enjoy the outdoor table, chairs and bench in the tropical setting. <BR />There is no laundry use on the property but Kailua offers such services.<BR /><BR />We are happy to help anyways we can so are available anytime. However we will give 100% privacy to our guests and have a self check in and check out policy.<BR /><BR />TA-(PHONE NUMBER HIDDEN)<BR />GE-(PHONE NUMBER HIDDEN)<BR /><BR />RESPONSIBILITY DISCLAIMER: Property owners are not responsible for any accidents, injuries or illness that occurs while on the premises or its facilities. The guest is ',1,1,3,189,21.3952,-157.736),('30e56424-c0f0-4e36-9523-f5e904bb3142','2017-03-25 02:17:06','2017-03-25 02:17:06','d96b80e3-2c05-4fb6-922e-36643005a530','61302be9-4b31-4be0-92fc-d0dda253e167','Main Street Farmhouse Silver Cloud!','Completely renovated quality 31-foot Airstream in the backyard of the Main Street Farmhouse. Sealy Posturpedic Full bed, bathroom, kitchenette, couch, dinette, flatscreen TV and wifi. Sorry, NO PETS allowed. We allow cooking our farm fresh eggs but no cooking meats, bacon, sausage, fish, etc. in the unit.<BR /><BR />Talk about Glamping!  You can go \"glamour camping\" right on Main Street in Napa California!  This fully renovated 31-ft Airstream has all the conveniences of home.  Fully plumbed with water and drain - plenty of water pressure!  Beautiful patio/yard area for you to enjoy too.  Main Street Farmhouse is licensed by the city of Napa and the price you see stated has the occupancy tax included already for your convenience.   There is no deposit required.  Continental Breakfast including Greek yogurt, homemade granola, English muffins, bagels, cream cheese, jelly and jam, coffee and tea is provided each day in the Silver Cloud.  You may fry farm fresh eggs from our chickens if ',1,1,2,130,38.3127,-122.294),('314b188e-990b-423e-ae63-f0199b8c2b17','2017-03-25 02:17:06','2017-03-25 02:17:06','1721b75c-e0b2-46ae-8dd2-f86b62fb46e6','70b18dcc-08ef-4040-91cf-4075973d320a','Cozy Guest Cottage with great deck','My place is just a short walk to downtown and everything Bisbee has to offer; art, restaurants and bars, antiques and attractions. There is off street parking. My place is perfect for a couple or individual.',0,1,2,75,31.4447,-109.924),('31568a3f-d5b1-47d1-b2ee-74339059e3a0','2017-03-25 02:17:06','2017-03-25 02:17:06','94f16095-5ce6-4bec-8114-d1f3fa6f2b16','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Florala, Alabama - whole cottage!','Craftsman style house one mile from Beautiful Lake Jackson.   Relax in the over-sized claw foot tub, while  rest of the clan is sitting on front porch sipping tea! Old fashion ice tea glasses await you! You will not want to go home-ever!<BR /><BR />The whole house is for our guests. Sleeps up to 6. However there is a $5 add on fee for over 4 guests. One bedroom has queen bed one bedroom has double bed and one bedroom has two twin beds. Bathrooms all claw foot tubs. Shower attachment hose only.<BR /><BR />Our neighbors are warm and friendly,<BR /><BR />Car is essential<BR />There is a short term lease<BR /><BR />Linens provided. ',3,2,6,78,31.0124,-86.3252),('328bd785-a91b-424c-afda-9e08e5155cfe','2017-03-25 02:17:06','2017-03-25 02:17:06','e4e40a6e-59ff-4b4f-ab72-d6d100201588','fa44780d-ac48-41ab-9dd0-ac54a15755cf','Classic and Modern Charm in Mid-City','Our 100-year-old house is historic and recently remodeled. The available guest room has a comfortable queen-size bed and closet space. It\'s conveniently located in Mid-City with easy access to Downtown Baton Rouge, LSU, the interstate, great local restaurants, grocery stores, the Garden District, nightlife, and the bus line. Ideal for couples, solo adventurers, and business travelers.<BR /><BR />Our house is a 100-year-old craftsman with 14 foot ceilings and great architectural details. We remodeled the house recently to accentuate its classic charm but fit it with our modern style. We hope you like it! The guest room has a queen size bed, closet space with hangers, and a TV with cable.<BR /><BR />All common areas, including living room, dining, laundry, kitchen, front porch, and bathroom.<BR /><BR />Convenient street parking is located directly in front of the house.<BR /><BR />We can interact as much or as little as you want. I\'m mindful of your privacy but love being a great host an',1,1,2,43,30.4438,-91.1643),('3290a4ef-4241-4fa5-843e-87926c74e384','2017-03-25 02:17:06','2017-03-25 02:17:06','14e2f358-f8fb-419c-8e8f-0017f971d82d','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Cozy Poolside Bedroom Next to ASU','I (Carlos) live here with my dog (Beia). We live down the street from ASU in a very nice neighborhood. The backyard is at your disposal. Beia doesn\'t like to swim so you can enjoy our pool, or the fire-pit and garden if its cold :)  <BR /><BR />We offer self check-in, so you can come and go anytime.  This listing is for a large room with a Full size bed and comes with desk space, closet space and a TV with a Chrome Cast so you can stream from your device. For LONG-TERM BOOKING message me directly.<BR /><BR />This listing is for a large room with a Full size bed but I have larger room with a Queen size bed if that fits you better. Each room has two chairs, an iron and ironing board, hamper, TV with streaming devices and plush blanket for extra coziness :)<BR /><BR />There are two bathrooms, one next to the rooms and another across the home in a hallway. The furthest bathroom has a cabinet that is always stocked with clean fluffy towels, next to it is a black hamper. Help yourself to the',1,2,2,58,33.411,-111.936),('32945f6e-5a96-4233-b8ae-048d51323d7b','2017-03-25 02:17:06','2017-03-25 02:17:06','1aef765c-3c91-47aa-a716-ffd3b8d748df','85651506-c13c-4c2f-9c79-8fbebc048e39','Lodging in Globe, AZ at Belle-Aire.','We provide friendly customer service, superior accommodations, and affordable rates to everyone visiting the Globe, AZ area. The room can have one or two beds, with private entrance to it and has microwave, refrigerator, 40inch LED TV, and WiFi.<BR /><BR />The room can fit up to