02:17:07','2017-03-25 02:17:07','be89d2ce-231e-4205-a8c1-e6bcf5990302','f9b11370-f316-492c-92da-014d7bce7213','An amazing place to stay. Super inexpensive, near light rail, a beautiful room and house, and very accommodating! Highly recommend. '),('2c6fa5bb-21dc-4b6a-8620-98e0b031a2d8','2017-03-25 02:17:07','2017-03-25 02:17:07','e3f28357-a476-4032-8726-4ac7262cbc72','d622edfa-fc35-4732-b5ec-a15d794267ec','I can\'t say enough good things about Jane and her place.  <BR /><BR />The place was just as described and represented a really good value in a location that often has tight hotel inventory and very high prices.  The home is in a quiet neighborhood, but just a short walk to downtown Napa and all of the restaurants and shops there.  Getting to St. Helena highway and Silverado were very easy as well.    <BR />  <BR />Jane\'s communication both prior to and during the stay was excellent.  She provided recommendations for things to do in the Napa Valley area and also gave two-spot on dinner restaurant suggestions.<BR /><BR />I\'d highly recommend Jane\'s place to anyone planning a Napa trip and look forward to staying there again in the future.'),('2e4c75fe-51ad-453c-ada0-328b9abafc3a','2017-03-25 02:17:07','2017-03-25 02:17:07','dce54621-9083-4cd9-9335-a9e8861289d8','8394fd35-8a8a-479f-a398-48f53b4a6554','Great location and accommodating. Staff was friendly.'),('2e6c4669-3e83-4a96-acc5-bbf85f463f0a','2017-03-25 02:17:07','2017-03-25 02:17:07','b6692019-ac4a-47aa-a671-89cd79c9e11f','70b18dcc-08ef-4040-91cf-4075973d320a','Great place for overnight stay, central location'),('2e85ee97-9adc-4e9b-850c-b66e849028d9','2017-03-25 02:17:07','2017-03-25 02:17:07','5463e312-5bf4-4764-8c06-e97c5548f712','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Really great place!'),('2f2ddfa5-99b8-4d9a-a6d9-f9187726c48a','2017-03-25 02:17:07','2017-03-25 02:17:07','eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba','150e591e-486b-48ee-be42-4aecba665020','Emily\'s place is conveniently located within walking distance to all the downtown restaurants and nightlife. The house is older so don\'t expect the Hilton. But do expect it to be clean and comfortable. Emily was an excellent host. We couldn\'t be there to greet her at 3pm check in so she left the key where we could find it<BR />She has local numbers and places written down if you don\'t know the area. And even allowed us a late check out(because it worked with her schedule) as we wanted to sleep in. <BR />I\'d recommend Emily\'s house if you looking to be able to go out downtown and drink and be able to walk and not drive.!!! '),('2f607848-04d7-4eb6-9076-485b280415fd','2017-03-25 02:17:07','2017-03-25 02:17:07','859a8a8f-9423-4bf6-b471-d9a7f39c9c2c','70b18dcc-08ef-4040-91cf-4075973d320a','This is the type of space that you stay in if you want to get away from the day-to-day rush and meet some very good people...Business travelers and personal travelers should both plan a stay here if you happen to be in/around the Tupelo area. I very much enjoyed my time at Brent and Cindy\'s space and look forward to staying there again in the near future. '),('2fe22742-fe8f-429e-aa72-d173509ba5fb','2017-03-25 02:17:07','2017-03-25 02:17:07','ef3f56b8-c024-471e-b7ba-be1a72c6cbec','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','Jake\'s place is perfect for one or two people. Overall, it was clean and neat and quiet! I never met Jake, but he was quite responsive to my needs via text when I ran into a few issues. It was an ideal location for me and I would like to return next time I visit Tempe.'),('30978ec3-63a2-452d-ae1c-e3f64e662ba1','2017-03-25 02:17:07','2017-03-25 02:17:07','df2548db-377d-422e-b805-4e8e0c794302','91e27a07-1f47-43c9-b851-60c6882abcd3','Minutes from UAB, major roads, grocery markets and other retail. The condo is very safe, gated with live guard, clean and comfortable. The views are stunning. Kevin is a great host and is willing to do whatever it takes to make your stay enjoyable. I highly recommend.'),('30982e18-b8f9-4733-9f42-de944dda7fad','2017-03-25 02:17:07','2017-03-25 02:17:07','e2d4feeb-4cb0-4df4-a10e-5a54748621b3','9eec6c06-5918-4867-833a-face490d4715','Inn the Oaks is a very comfortable, clean, welcoming place. If you get a chance to sit down and talk with Jane, do. She\'s wonderful, and she made me the best breakfast ever. I\'d love to stay there again. '),('322c77dc-d8a7-4be4-94f7-7cf5ffa6e639','2017-03-25 02:17:07','2017-03-25 02:17:07','52cc10db-af9b-499c-aa8e-670056611a7c','7771bbe9-92ab-46d1-a636-864526361d7d','Great place at a great rate in the Capitol City!'),('325a672c-45cc-450a-ba47-c59df51902fd','2017-03-25 02:17:07','2017-03-25 02:17:07','073084e1-1d9d-49e6-8383-42ef6f4325b5','df668e22-e344-4c89-a050-e5ad211cbaa6','My wife and I were very impressed with our first stay in an Airbnb rental. It was wonderful. We had a very restful time and will surely stay here anytime we are traveling through Tupelo. We felt very secure. Vince\'s place is walking distance to many of Tupelo\'s attraction yet it is still very secluded in a very upscale neighborhood. We couldn\'t have asked for better. Thank you Vince!'),('3310ffc4-d046-47a4-8645-157cfa2b7c65','2017-03-25 02:17:07','2017-03-25 02:17:07','cff8a023-eacb-4a38-a24f-a01fe9ddde18','91e27a07-1f47-43c9-b851-60c6882abcd3','Cara\'s place is amazing, The beach is only a few blocks away.  The inside was immaculate and decorated with authentic Hawaiian artifacts. Cara and her family were great host. We will definitely be coming back to stay.  '),('33ec4f6e-891f-4a22-8542-3efb555b13c4','2017-03-25 02:17:07','2017-03-25 02:17:07','e58517c1-3214-465f-a982-78208a3266c0','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','This is a perfect place to take a group to help volunteer in rural Alabama or visit the Civil Rights Movement sites!'),('33ec75c5-22ca-4b81-9647-f86e3e319ee8','2017-03-25 02:17:07','2017-03-25 02:17:07','ad4cd1fe-3358-4183-8062-59e39824175c','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','It was like we stepped back in time to Antebellum Era Alabama. Why stay in a hotel when you can live like this for a few days. Ian, our host was incredibly accommodating. Breakfast was made for us every morning. I wish we could have stayed longer. '),('33f3ea40-e5b7-4d08-a722-e17311037199','2017-03-25 02:17:07','2017-03-25 02:17:07','14e9cb05-e188-4e02-ab2c-8ef425e5ea64','887dcd8d-d5ee-48de-9626-73ff4ea732fa','She made me feel welcome, and relaxed. She is available and overall a good experience'),('34167ed5-d42e-4c0c-9b43-614b5f7ae41f','2017-03-25 02:17:07','2017-03-25 02:17:07','3290a4ef-4241-4fa5-843e-87926c74e384','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Carlos could not have been more accommodating, hospitable, and professional.  I was truly thrilled with our experience at his home. It was immaculately kept, modern yet classic, and made to feel our own. <BR />Carlos showed his true kindness when my fianc and arrived a few hours before our scheduled arrival time (traveling can confuse the best of us) and yet Carlos quickly turned over our room and allowed us to settle in. The self check in and out was also much appreciated. <BR />The location couldn\'t be better, either. His home is walking distance to many restaurants and bars catering to the ASU and Tempe community.  We were a moderate drive to Peoria where we watched a couple Mariners games and a 45 or so minute drive to great hiking at the Superstition Mountains. <BR />We will definitely look to staying with Carlos in the future and I recommend you do the same. '),('343b878c-6bab-4d46-a512-6b3d1b70b653','2017-03-25 02:17:07','2017-03-25 02:17:07','bc227cc3-0ad7-4b9a-b72a-6c2a45e6a88a','f33e2624-520b-4bc2-b6a0-190ee1d41855','Hosts were very responsive and helpful. The house was conveniently located, large, clean and very comfortable. Having 3.5 bathrooms is a big plus. The 5+ bedrooms were very comfortable with nice bedding. Bathrooms were also very nice. Internet was easy to access. Lots of amenities -- hair dryers, shampoo, lotion, etc. Television channels are  limited, so plan on using Netflix/other. '),('346e0190-4410-498a-827f-c353e9f6153e','2017-03-25 02:17:07','2017-03-25 02:17:07','b33cae89-fe4f-4c6e-a1c5-0022450f2bf2','426624f6-84a9-4ec4-84f3-7655dc70e86e','Loved everything about the rental.  We arrived late at night and everything was set for us to have a stress free check-in.  The rental was clean, well-stocked with coffee, granola bars, bottled water and even croissants.  The rental is very private and the neighborhood is quiet.  We stayed a total of 3 nights and were not around much during the day. In summary, the rental exceeded our expectations, Michele was very responsive and professional throughout all communications. Would highly recommend.'),('34ceb933-d2cc-436d-a57e-176933476d3b','2017-03-25 02:17:07','2017-03-25 02:17:07','ae787938-171f-4563-8c75-92a037fed415','cf1780e6-d294-4113-8749-1c728b9e3f81','Hannah and Richard\'s home was beautiful and clean. They are great hosts (and decorators!). They were super accommodating and friendly. I would definitely recommend staying with them.'),('35087f35-2eb7-4d6b-a14a-fab6c593f774','2017-03-25 02:17:07','2017-03-25 02:17:07','836bea96-c22d-46d2-9335-b97cec4cc30a','30a890e4-a62c-44f9-abc0-07e2c74021da','Ellen\'s house was everything that you imagine Southern hospitality to be. A very friendly host with interesting conversation . We thoroughly enjoyed our stay.'),('350e6904-26de-4229-a766-5731b48542bc','2017-03-25 02:17:07','2017-03-25 02:17:07','7354ea6c-3c0e-4800-aad8-708c29a6c067','887dcd8d-d5ee-48de-9626-73ff4ea732fa','Close to public transport. Good value for money. Hardly any interaction with the hosts.'),('35cebfe1-c6a1-4ac2-9368-6057297483da','2017-03-25 02:17:07','2017-03-25 02:17:07','e58517c1-3214-465f-a982-78208a3266c0','00a11245-12fa-436e-9ccc-967417f8c30a','I have stayed at the bunk house several times now and it is as expected.  Perfectly fine.  Pam is as welcoming as can be and is always around to help if needed.  I like the bunkhouse and would stay there again.\n<BR />\n<BR />Dave\n<BR />PS....I got the WIFI working so there is internet in the house now.'),('35d605df-1c08-49f7-a6d8-18c860c30378','2017-03-25 02:17:07','2017-03-25 02:17:07','9c5a1e44-0090-464b-ac3b-89e0f65cc6e1','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','I really enjoyed my stay at Lauren\'s. It\'s perfect if you want to be able to easily access the entire island because it\'s just as far from Ka\'ena point as it is to Haleiwa. The shared room was perfect because I was only there to sleep. One thing I loved was how close this Airbnb was to a Buddhist temple. I would definitely stay here again.'),('362bb9ff-0168-49e4-bf7f-727a64cddfb3','2017-03-25 02:17:07','2017-03-25 02:17:07','12ff7d06-9910-41cd-9eee-bdc21476d119','91e27a07-1f47-43c9-b851-60c6882abcd3','Dana\'s place was as described, comfortable, clean, adorable, and very walkable to Waikiki! Would definitely recommend for your stay!'),('36429951-2841-4f93-8bda-f6106a0039ab','2017-03-25 02:17:07','2017-03-25 02:17:07','30e56424-c0f0-4e36-9523-f5e904bb3142','30a890e4-a62c-44f9-abc0-07e2c74021da','Charming and cozy.  A really unique experience (assuming you\'ve never stayed in an Airstream) but has all the amenities you might need and a wonderfully comfortable bed.  A fantastic option for a special and unique place to stay in Napa.  If you\'ve bookmarked this place and are considering it among other options, BOOK IT.'),('36d880b3-1b80-4f0f-86bb-b855853579a8','2017-03-25 02:17:07','2017-03-25 02:17:07','610ef600-53da-4e05-aaaf-b7ae4d14fcfb','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','Great communicator and a great place to explore St. Paul! Near lots of shopping and good restaurants, very nice and walkable area. Parking is readily attainable as well.'),('370c007d-8e0c-41c2-8d8f-1eb930bbd702','2017-03-25 02:17:07','2017-03-25 02:17:07','3ebfaf23-cede-4cf0-964d-8afc17b11d02','00a11245-12fa-436e-9ccc-967417f8c30a','This is a beautiful place with very thoughtful and gracious hosts. The neighborhood is lovely as well. I hope to go back and stay longer next time.'),('3763bf41-a515-4b70-affc-56a6d48c290a','2017-03-25 02:17:07','2017-03-25 02:17:07','b56cb489-da79-4028-bcc0-7251324606f0','b6160096-c503-4909-a674-7bfbddc8cc45','The picture with the spa on the deck tells the story. This is a great place to stay while enjoying the leeward side of Oahu. The appearance of this home from the street is deceiving. Don\'t let this turn you away. Once inside you\'ll be taken in by the view and the very cool interior decoration. Jim collects vintage furnishings and he and Maki have decorated the interior in an attractive and artful manner.\n<BR />\n<BR />Of course, it\'s the hosts that make or break a stay at an AirBnB. Maki and Jim made us feel right at home. Maki makes delicious and creative breakfasts. \n<BR />\n<BR />Keep in mind that you\'re not right in a town. The nearest Starbucks is a  5 to 10 minute drive.  One of the features we liked was that most everything we wanted to see or do was within 30 minutes. On the other hand, depending on how you look at it, everything is at least 30 minutes away. No problem for us.'),('3777d4fd-e5fd-4602-9153-fca83172618d','2017-03-25 02:17:07','2017-03-25 02:17:07','43803445-1874-4a3c-94e9-955fcb25089b','426624f6-84a9-4ec4-84f3-7655dc70e86e','Clean<BR />Cozy<BR />Well organized<BR />Easy to check in'),('3793e6c6-664e-45fa-b429-4dd9a0fd7c6f','2017-03-25 02:17:07','2017-03-25 02:17:07','aaf389be-c794-4fb4-a6cf-619ca956898f','8394fd35-8a8a-479f-a398-48f53b4a6554','Perfect stay! Melanie made us feel so welcome and made our travel plans as easy as can be. The space is so comfortable and centrally located; just a few minute drive into the main area of town with dining and shopping and was perfect for our 3 day stay in town for exploring wineries in Napa, Sonoma and Calistoga. Highly recommend and would definitely stay again!! '),('37dc3555-8753-4748-a226-3ca446cef6ce','2017-03-25 02:17:07','2017-03-25 02:17:07','859a8a8f-9423-4bf6-b471-d9a7f3