72c6cbec','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Location is really close to downtown Tempe.  The apartment was cozy and clean.'),('4866d45d-9c21-4d13-bb39-f62bc2bf233a','2017-03-25 02:17:07','2017-03-25 02:17:07','478d6061-fc78-40c3-a1b2-0e906fb86da8','00a11245-12fa-436e-9ccc-967417f8c30a','Quiet, clean, comfortable, great location - just what I needed!'),('48771e28-30db-40ba-8001-d5f58d9c48d7','2017-03-25 02:17:07','2017-03-25 02:17:07','ff46f903-411b-4a16-8e16-1aab7f00686c','887dcd8d-d5ee-48de-9626-73ff4ea732fa','The Boarding House is exactly as advertised. I met four very nice people, including Tiffany and Ryan. The space is relaxed, clean, and eclectic. T & R have extra nice touches to make guest comfortable and welcome. I was there two nights and would come back to stay here on another visit to Bisbee. <BR /><BR />The location is just super. About five minutes or less from all of the city fun when you walk downhill. Five minutes to great visuals, birds, and flowers when you walk up OK Street. '),('488e5739-759e-4c33-b7f9-aff5ba897419','2017-03-25 02:17:07','2017-03-25 02:17:07','dbdc349b-a195-474f-9856-dbe01d08c331','b6160096-c503-4909-a674-7bfbddc8cc45','Welcoming. Small, comfortable room and a nice bathroom at the end of the hall. Very quiet. Thank you for letting me stay!'),('4989a032-71f1-4abc-ab0d-486702c9c915','2017-03-25 02:17:07','2017-03-25 02:17:07','dbdc349b-a195-474f-9856-dbe01d08c331','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','Inexpensive place to stay with just the basics. Clean. Nothing fancy. Perfect if you just need a quiet place to sleep.'),('4994bf49-62e2-4cfe-b2f5-f64bd93a2a11','2017-03-25 02:17:07','2017-03-25 02:17:07','e2d4feeb-4cb0-4df4-a10e-5a54748621b3','cf1780e6-d294-4113-8749-1c728b9e3f81','I was arriving around 9:30 on Easter night. I was met and warmly greeted. After a quick tour, I had the entire house to myself!  Everything is very clean and very charming. I met Pat, Randy and Jane. All were delightful. The breakfast is a super fantastic surprise. If you are in the area, book a room!  You will not be disappointed '),('49a0f733-d01f-4cbb-8b40-2a758e317c8d','2017-03-25 02:17:07','2017-03-25 02:17:07','48bf9579-0f57-426e-9051-a4d3507ad7cd','9eec6c06-5918-4867-833a-face490d4715','We enjoyed our stay at Stacie\' s home. For the price we paid we had a comfortable, happy experience.'),('4a641ad6-cd31-4df0-820f-546118bea5cb','2017-03-25 02:17:07','2017-03-25 02:17:07','f19fa153-154e-440b-9f4b-debee403b0d2','f33e2624-520b-4bc2-b6a0-190ee1d41855','I stayed for 9 weeks as a clinical student at Edward Hospital, and I thoroughly enjoyed my stay. Great drive to work, home was lovely, and Kathi is an amazing host. She welcomed me like family (even took care of me when I got the flu), which made the academic stresses far more manageable since I wasn\'t worried about my living situation on top of it. Also her home is really close to downtown Naperville (5 minute lyft/uber) but in a quiet community, which is like the best of both worlds. I can\'t give her enough stars! '),('4a91fc4a-6e0e-43e1-9454-d404847d7de5','2017-03-25 02:17:07','2017-03-25 02:17:07','e6c33577-5de3-4481-9147-47ef4710b986','7771bbe9-92ab-46d1-a636-864526361d7d','Lani\'s house was central and not far from the airport. About a half hour away from most places and attractions. Lani was benevolent and hospitable. She didn\'t hesitate to help us with anything we asked for or needed. We also met her family and they were nice too! We were out most of the time and she understood and respected that. She even washed our clothes while we were out! This place is PERFECT for people who visit Oahu to go out and explore the island but don\'t want to sit by a pool all day. Thanks, Lani!!'),('4ab0b168-fc47-47cb-8643-97f4ab3b18ea','2017-03-25 02:17:07','2017-03-25 02:17:07','d991f849-0f2f-41cb-b6d7-41feee6bc943','00a11245-12fa-436e-9ccc-967417f8c30a','Really nice room with balcony, attached bathroom, and walk in closet. I was very comfortable. '),('4b2d0cc2-a030-4002-aa2f-e269bf6a8015','2017-03-25 02:17:07','2017-03-25 02:17:07','0d10682b-5bd4-4fde-9427-0067fe6ff63c','9eec6c06-5918-4867-833a-face490d4715','Great, convenient spot for a lot of te cool spots in Birmingham. And the beds were quite comfortable! '),('4b976ffb-a8e9-42b4-9771-fc8e2e69cb60','2017-03-25 02:17:07','2017-03-25 02:17:07','2b6e6650-5f69-426d-a084-71f7ad30d1f1','91e27a07-1f47-43c9-b851-60c6882abcd3','We stayed at Nathalie\'s place in Kailua for a week and loved it. It was close to the beach and shops, everything we needed was only 5 minutes away. Nathalie was always very quick to respond with any questions and is a lovely person. I would certainly stay here again!'),('4bbc633c-b593-426f-8d81-38438718434b','2017-03-25 02:17:07','2017-03-25 02:17:07','e2d4feeb-4cb0-4df4-a10e-5a54748621b3','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','Everything was great at Inn the Oaks. It\'s a real B&B, and the owners were very accommodating of my late arrival time and came over to meet me. The place has been recently remodeled with great care and was spotlessly clean and the bed was super comfortable. Jane, the inn keeper is charming and made me a great breakfast of grits and bacon. I definitely recommend staying here!'),('4bbf30c9-6b1e-4251-811f-67b97de477a7','2017-03-25 02:17:07','2017-03-25 02:17:07','bb86e624-9ecb-4aca-a713-8cd6984f25a0','f9b11370-f316-492c-92da-014d7bce7213','We spent two nights in Pippa\'s place and we had an amazing time !! The place is super cosy and confortable and Pippa is a great host making sure you have everything you need, and sharing with you tips and advices on what to do during your stay ! Highly recommended to visit this beautiful region and to feel like home :) '),('4bcca9d8-d866-45d8-84ab-3ed97215b393','2017-03-25 02:17:07','2017-03-25 02:17:07','552b5aaf-33b7-407b-a2dc-459ab730b3a5','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','What a wonderful condo and host. Everything was brand new and very clean. Annie was available at all times and check in was very easy. Just a quick bus ride to Waikiki Beach and great access to Walmart, Pharmacy and other restaurants. Definitely great for professionals and tourists.  '),('4bd3764f-9525-4341-9e7f-c8293f71da7e','2017-03-25 02:17:07','2017-03-25 02:17:07','b7a46879-c82a-46d9-9ea9-43cbefca2f81','b6160096-c503-4909-a674-7bfbddc8cc45','Barbara\'s place is clean and wonderful! They are super nice and willing to share all they know about this town! You will not regret choose this place! '),('4c4bc8c9-6fd3-497e-9b19-e018d8a9d78a','2017-03-25 02:17:07','2017-03-25 02:17:07','62e75faa-d265-4ca1-a009-1e06f1d6ab14','70b18dcc-08ef-4040-91cf-4075973d320a','Ellie is an excellent hostess and was very helpful in answering my questions about Chicago. It was a very clean apartment with an amazing view. The location was close to great restaurants and attractions. '),('4d0ec895-5e31-48df-b326-bcbc03498cd1','2017-03-25 02:17:07','2017-03-25 02:17:07','9c7d3ecd-9592-4910-bd04-91c59e8350f1','8394fd35-8a8a-479f-a398-48f53b4a6554','Chris\' pool house was exactly what I needed after a long day on the road. Very quiet and unique. Sat by the fire pit, listened to my tunes on the rock box, and sipped bourbon. Chris communicated timely, described everything accurately, and had everything ready when I arrived. Looking forward to the next visit!'),('4d325840-91c9-4725-ab72-7968d57fcb06','2017-03-25 02:17:07','2017-03-25 02:17:07','0a454f9a-eaac-488b-8443-23cf58f7ae37','df668e22-e344-4c89-a050-e5ad211cbaa6','Great location!  Busy all day exploring the island.  Best location,  walking to beach for sunrise was such a wonderful and peaceful experience'),('4d35bb60-a8b7-453e-aff7-0db17fc372be','2017-03-25 02:17:07','2017-03-25 02:17:07','cb681375-76ad-41d4-ac03-7fe74df9aed3','d622edfa-fc35-4732-b5ec-a15d794267ec','We loved staying in this cozy place! Perfect walk to Kailua beach. My favorite part was how QUIET AND PEACEFUL it was! My husband and I were visiting from a city life and we both felt like we slept like babies! Perfect breezes, crickets and birds- but quiet residential neighborhood. Michele was super accommodating! Thank you for a great week!! Mahalo!'),('4d4aadba-246c-41e2-9acd-d2c48ad59f08','2017-03-25 02:17:07','2017-03-25 02:17:07','38e38612-a626-47a9-a699-05efa178e155','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','If you like the family feeling or you are a group of travellers, this could be your place. The apartment is wide with 6 rooms, mine had 2 bunks but I don\'t know about the other rooms. Also you will find a nice swimming pool.<BR />Mario is a nice host, and the communication with him was easy.'),('4d7a1d3f-f209-42df-80e1-21cf871009c1','2017-03-25 02:17:07','2017-03-25 02:17:07','c29b5191-ac68-4e9b-a68f-aa42ea1dcb01','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Cayla was great. Her home is beautiful and she was a great communicator!'),('4dcfbc6b-a065-4467-b8af-eb8df2ea2885','2017-03-25 02:17:07','2017-03-25 02:17:07','7eceb696-213d-42cf-a58d-fa2e47cfdada','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Great place. Beautiful home in a nice quiet neighborhood'),('4dec3a16-d121-4b1b-9bce-3b046ead7388','2017-03-25 02:17:07','2017-03-25 02:17:07','0d10682b-5bd4-4fde-9427-0067fe6ff63c','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Robin and Haynes are incredibly sweet, approachable and helpful. They offer a lot of great recommendations about things to do, and Robin is very prompt with her responses about check-in and information about her place. An added plus is that her dogs are very adorable and friendly. And as someone with a mild allergy to dog dandur, I had no trouble and didn\'t sneeze once. The place is very clean and cozy. The house is very close to the Vulcan Trail, so if you are someone who enjoys a good view and nice walk, I\'d highly recommend staying in the area. '),('4e1c7270-2302-4c39-9d4e-dd5d393a8d2e','2017-03-25 02:17:07','2017-03-25 02:17:07','b33cae89-fe4f-4c6e-a1c5-0022450f2bf2','61302be9-4b31-4be0-92fc-d0dda253e167','I stayed at Michele\'s place for 2 nights. The place is exactly like the pictures in the listing. Being a 1-minute walk to the beach was the best. Michele provides extra towels and beach towels; it came in handy for our beach trips every day. Michele is a great host and very responsive. We didn\'t encounter any problems while staying at her place. Thanks Michele!'),('4e456426-ed11-45c8-b9fb-c9dad66d1db5','2017-03-25 02:17:07','2017-03-25 02:17:07','09b4888f-0e06-4ab1-abbc-05e9865634d0','d622edfa-fc35-4732-b5ec-a15d794267ec','Beautiful room in a perfect location to downtown Baton Rouge. Quiet neighborhood and nice and friendly owners. They have good timely communication when trying to book something. Room very nice and clean with separate entrance and bath from rest of the house. '),('4e745a31-8d5c-496a-8d2c-71891b702faf','2017-03-25 02:17:07','2017-03-25 02:17:07','dce54621-9083-4cd9-9335-a9e8861289d8','85651506-c13c-4c2f-9c79-8fbebc048e39','Fantastic place, great staff, close to great places for entertainment..... '),('4f062ce4-6234-4977-9b62-55d968b9d39f','2017-03-25 02:17:07','2017-03-25 02:17:07','d991f849-0f2f-41cb-b6d7-41feee6bc943','91e27a07-1f47-43c9-b851-60c6882abcd3','Had a comfortable stay here. First Airbnb so I wasn\'t sure what to expect and have nothing to compare this experience to. The price was good for the stay -- some things were lacking IN ROOM like cups/water... and communication, but overall it wasn\'t a deal breaker and I would stay again. '),('4f43e15c-9a3b-4808-8645-62b2501c2023','2017-03-25 02:17:07','2017-03-25 02:17:07','e979e012-bcb1-47ea-bb39-140cdfe0f917','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Clean, comfortable, quiet, basically perfect for two or one person. It has its own bathroom which was really nice. Clayton gave us some suggestions of hikes around the area that were really cool! It was also nice to use the kitchen if we needed it. Overall a great place!'),('4f501f92-3a0f-4ec2-b0af-5cb3b2253008','2017-03-25 02:17:07','2017-03-25 02:17:07','9c5a1e44-0090-464b-ac3b-89e0f65cc6e1','3ea61b06-e22a-459b-bb96-d900fb8f843a','This place is great if with friends or people you know! Very cute set up and everything you need. The open air feel is nice in the shower and bathroom! Unfortunately didn\'t see or play with the dog during my stay. '),('5022106d-619e-4087-9aac-7b2e866980b5','2017-03-25 02:17:07','2017-03-25 02:17:07','eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba','b6160096-c503-4909-a674-7bfbddc8cc45','I took a bachelorette party to Lafayette for the weekend, and we had a great time at Emily\'s. While not fancy, it was clean and comfortable. She made up the beds and futon for us, which was very nice! The location was walkable to a few bars and restaurants, and it was 5 minute drive to the rest of town. We enjoyed hanging out at the eat-in kitchen. Lots of natural light in the house! The price was so reasonable, and Emily answered all of my questions. I would totally recommend this host and house!'),('5076d997-adb0-428c-ba9e-18ce6c7785e4','2017-03-25 02:17:07','2017-03-25 02:17:07','6f59f0c7-f3f6-419f-9a8c-9d998a3b681c','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','It was great to get to know Daniel and his fiancee. He was very warm and welcoming. Daniel and my wife got along well and that helped my wife settle in being new to US. The place itself was clean and nice. I would definitely recommend this airbnb to others.'),('50967d43-75c9-4576-81ea-bd2a578c0f38','2017-03-25 02:17:07','2017-03-25 02:17:07','cb681375-76ad-41d4-ac03-7fe74df9aed3','9eec6c06-5918-4867-833a-face490d4715','Highly recommend this place! Host is incredible, went with my 7 year old Son and we had a great time and felt welcome every day!'),('516b03b7-f1d0-4a64-8756-f196e48f3e53','2017-03-25 02:17:07','2017-03-25 02:17:07','d3fc84bb-8ccd-4457-99a8-91dda88dc64d','70b18dcc-08ef-4040-91cf-4075973d320a','Pros :<BR /><BR />Price <BR />Locations<BR /><BR />Cons :<BR /><BR />Air mattress <BR />Too much people (I didn\'t expected to be that big)<BR />We were in room in the way to kitchen, bathroom and other rooms, so very noisy avec people passing by our room... <BR /><BR />The number of people could be a good thing to meet new people and make friends... but be aware of the cons if you are fine with that the location is convenient, I didn\'t have good nights of sleep there but you cannot beat the price '),('5177c5e6-d7f7-4133-b05c-40ee4f46ef13','2017-03-25 02:17:07','2017-03-25 02:17:07','d72f839c-9390-4085-9d39-b45144c9c3c8','f33e2624-520b-4bc2-b6a0-190ee1d41855','Worth the stay - very relaxing. Very rustic and peaceful especially at night. '),('518ae513-811d-4a28-9c10-6f9a28944bb7','2017-03-25 02:17:07','2017-03-25 02:17:07','478d6061-fc78-40c3-a1b2-0e906fb86da8','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Great place, really nice guy! Very helpful!'),('51c82d5e-5193-4488-b471-551f19d6c36c','2017-03-25 02:17:07','2017-03-25 02:17:07','be13aa0e-8da7-4943-be05-5fd89f4d18e6','00a11245-12fa-436e-9ccc-967417f8c30a','Reeva was cool and chill just like her place.    Very hospitable! I think the bed was made out of clouds.  I slept so good! She had water and little snacks for me in the room.  Great place to stay if and when you are in Tupelo, MS!'),('528d30c2-f969-4ec9-aeee-5028673a60f3','2017-03-25 02:17:07','2017-03-25 02:17:07','eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Staying at Emily\'s place was great. Especially since we brought our dog on our trip. Thank you Emily for your hospitality.'),('52d32d59-3174-4b39-8e23-fe8a1f3863be','2017-03-25 02:17:07','2017-03-25 02:17:07','0675a2d6-f64c-4be7-9a8a-f55341f09d4b','85651506-c13c-4c2f-9c79-8fbebc048e39','this was fine for what i needed. it\'s not a space to spend time in, but the futon bed was comfortable, and the place was heated well.'),('53224507-ecb9-40c8-a3e5-33ad5686eb73','2017-03-25 02:17:07','2017-03-25 02:17:07','6d24beec-f296-473c-a34a-4dd9aab8a780','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Stellar spot'),('53e42a62-bd5c-495e-aa23-390567c38ba2','2017-