e. I\'ll definitely plan to stay there again if I\'m in the area.'),('54e3cc07-cd68-4f5f-84d8-b446ce8c2206','2017-03-25 02:17:07','2017-03-25 02:17:07','12ff7d06-9910-41cd-9eee-bdc21476d119','7771bbe9-92ab-46d1-a636-864526361d7d','Stay was great! Close to downtown! Great Communication from host! '),('5556fe9e-3f98-42de-88d0-a43bd16c66f9','2017-03-25 02:17:07','2017-03-25 02:17:07','02d9a2b5-7dca-423f-8406-707bc76abf7e','cf1780e6-d294-4113-8749-1c728b9e3f81','Irene and Don\'s place is nothing short of wonderful. We so enjoyed it there. A sunny evening porch, extra little touches-mini breakfast items and lots of care, and attention to making sure we had everything we might need.  We felt at home immediately. It is only a couple of miles from Old Bisbee and well worth the short drive. '),('55677153-9bdc-4c5d-b4b9-ea6010c46a03','2017-03-25 02:17:07','2017-03-25 02:17:07','610ef600-53da-4e05-aaaf-b7ae4d14fcfb','150e591e-486b-48ee-be42-4aecba665020','If you are staying in the st. Paul area this is the place to stay. It is small so no more than two people but it is great. The area is also great.'),('55b8a54e-4ebc-4f8d-911a-4aa9d039c602','2017-03-25 02:17:07','2017-03-25 02:17:07','ff46f903-411b-4a16-8e16-1aab7f00686c','f9b11370-f316-492c-92da-014d7bce7213','The Rooming House has so much character. It comes fully equipped with everything you need for a great stay and even has extras like toiletries for anything forgotten. Ryan met us and was genuine and very helpful. The location is great and you can walk anywhere. My boyfriend and I had a great time.'),('55d11ec8-5819-442f-86ba-7fcfdf920d7b','2017-03-25 02:17:07','2017-03-25 02:17:07','be89d2ce-231e-4205-a8c1-e6bcf5990302','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Very nice person. Very disponible. This is where I will stay when I am in St Paul. Nice room. Bed is comfortable.  The host try to make you feel at home. He does a very good job at it. Thanks!'),('55d69a73-aa35-43c5-8590-9c2c2cc9ceeb','2017-03-25 02:17:07','2017-03-25 02:17:07','7eceb696-213d-42cf-a58d-fa2e47cfdada','61302be9-4b31-4be0-92fc-d0dda253e167','Nice room in a very nice house. David was a great host!'),('55f5c921-4c85-4dfa-b54e-874168113ef1','2017-03-25 02:17:07','2017-03-25 02:17:07','073084e1-1d9d-49e6-8383-42ef6f4325b5','f33e2624-520b-4bc2-b6a0-190ee1d41855','Our group included my 81 year old mom and 16 year old son. The Barbecue Festival took place in his back yard (so to speak) But inside Vincent\'s home was quiet and peaceful.  Vincent was so genuine and pleasant. And his home is beautiful and comfortable.<BR />We truly enjoyed our stay!<BR /><BR />'),('5628eb1b-384c-4f46-af69-0061b5864047','2017-03-25 02:17:07','2017-03-25 02:17:07','b6692019-ac4a-47aa-a671-89cd79c9e11f','70b18dcc-08ef-4040-91cf-4075973d320a','Great apartment in a central location. Mason responded super quickly to all my questions and his place was clean and comfortable. Also, the bed was crazy cozy. '),('566ccd60-acff-4e60-ac66-cec46444d301','2017-03-25 02:17:07','2017-03-25 02:17:07','62e75faa-d265-4ca1-a009-1e06f1d6ab14','9eec6c06-5918-4867-833a-face490d4715','Ellie\'s place is great. You\'ll find a very comfortable apartment in the heart of Chicago. The views are breathtaking and Ellie does a great job communicating and accommodating. Great central location walking distance to a lot of attractions. Very clean place with a warm welcoming vibe. I definitely recommend booking her place when visiting Chicago. I certainly will! '),('56c3460c-417c-4c5f-9a0e-af5356383844','2017-03-25 02:17:07','2017-03-25 02:17:07','8fba447b-e04f-41c5-a730-848ef02758a9','426624f6-84a9-4ec4-84f3-7655dc70e86e','This was the perfect place for a weekend get away. Amanda was a generous host from the Netflix available on the TV to the chocolates on the bedside pillows. She was always available incase we needed anything. Very close to downtown St. Paul and great restaurants. Can\'t wait to come back to Minnesota and visit soon!!!'),('56eb5858-cfc7-4472-9787-db0417ac7e6