led in we found the house to be very clean, cozy and inviting. While this is a 100+ year old house, it appears to have been renovated recently. Plenty of room in the dresser and closet to unpack. The office sized water cooler was a thoughtful amenity in a dry climate. We loved getting up in the morning, making a pot of coffee (great local roast provided), and enjoying a cup or two on the front porch, in the sun, overlooking the town and the view beyond. The downtown is a short walk from the house, either directly down the stairs, or down the road. As '),('813bae8a-b49e-4c3b-abb4-ec6d78d3c923','2017-03-25 02:17:07','2017-03-25 02:17:07','8fba447b-e04f-41c5-a730-848ef02758a9','7771bbe9-92ab-46d1-a636-864526361d7d','Fantastic.  So happy I get o come back!'),('817fda18-eff6-43a7-ac2b-33d3918073a4','2017-03-25 02:17:07','2017-03-25 02:17:07','e990e07f-1b6f-4bc5-a553-ddddad30211b','426624f6-84a9-4ec4-84f3-7655dc70e86e','Four of us stayed a couple days for work. The house is clean, safe and comfortable. Much better than a hotel. Thanks Suzy.'),('8291fdb3-3717-4dfe-97cb-1e1bc12151d7','2017-03-25 02:17:07','2017-03-25 02:17:07','78ca76e7-78dc-4867-8281-50ab3dc47cdd','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','Consistent and excellent, every trip. '),('82a72de8-b45f-4477-8925-69e07d01b8d9','2017-03-25 02:17:07','2017-03-25 02:17:07','b4a927e4-9715-4cd2-9918-47491f97df3e','b6160096-c503-4909-a674-7bfbddc8cc45','Doug and Deb were incredibly friendly from the get go. They are very knowledgable about the area and have great suggestions for food and wine.. Would definitely stay there again given such wonderful hospitality '),('82e06396-00d6-402c-ab66-1abbecc37953','2017-03-25 02:17:07','2017-03-25 02:17:07','e58517c1-3214-465f-a982-78208a3266c0','70b18dcc-08ef-4040-91cf-4075973d320a','Pam is amazing! Very hospitable and friendly. Home is perfect for small group with large kitchen. Making plans to go back!'),('82e79f85-e149-43b6-b46c-00668d2d5d2d','2017-03-25 02:17:07','2017-03-25 02:1