th sufficient street parking and its close to the airport too.'),('8925764c-4e79-4c06-9c8a-c91af6d8e28d','2017-03-25 02:17:07','2017-03-25 02:17:07','0675a2d6-f64c-4be7-9a8a-f55341f09d4b','7771bbe9-92ab-46d1-a636-864526361d7d','Sofia was amazing. She kept in communication at all times and was very helpful giving recommendations etc. The location is perfect and the place was very cozy and welcoming. Thank you Sofia! '),('893b0ce6-5094-42c8-9b9f-51bc1d8ca254','2017-03-25 02:17:07','2017-03-25 02:17:07','8fba447b-e04f-41c5-a730-848ef02758a9','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','Amanda and her husband were so nice. I loved staying (URL HIDDEN) was really the perfect place with a rowdy 5 year old. I would definitely stay here again!!'),('8984fb14-7da0-41c8-b568-7802b9681551','2017-03-25 02:17:07','2017-03-25 02:17:07','b56cb489-da79-4028-bcc0-7251324606f0','00e93fc3-53ff-4da4-8e72-faa5216f81bb','I and my wife stayed in Jim&Maki\'s house for our first travel in Hawaii. They are very nice and their house was great especially for couples. Maki\'s breakfast was perfectly fit for us and really yummy. She cooks only using organic vegis, which makes us healthy in the morning. One day, we got together. Jim let me know how I can cook his secret Steak that was fantastic flavor with red wine. I will never forget our staying with them. If anyone would like to stay in O\'ahu island, I will definitely recommend Jim&Maki\'s house ! Their house is located in the center of island, which is very convenient to drive to any place in the island. The house and room are exactly the same as in photo. We have no problems with laundary, shower, cooking, and so on. Neiborhood is very quite, so that we sleep deeply. Thank U Jim and Maki ! '),('89f37b0b-2606-4ed3-b8a7-92bafe0de9db','2017-03-25 02:17:07','2017-03-25 02:17:07','1014dfdf-fa7a-487c-bba8-2d3076d570dc','426624f6-84a9-4ec4-84f3-7655dc70e86e','Great space, very clean with ample outdoor space in backyard. Very close to downtown ($6+ Uber). Randall is a great host and very willing to help us find our way around town. Overall a great and carefeee stay!'),('8a3dc9e6-1031-42ce-8b3e-d17b094b54f2','2017-03-25 02:17:07','2017-03-25 02:17:07','e3f28357-a476-4032-8726-4ac7262cbc72','30a890e4-a62c-44f9-abc0-07e2c74021da','Jane is a great host, very responsive to messages, provided great tips for enjoying the local area. Their home is in a quiet neighbourhood, 25 mins walk from downtown Napa. '),('8a5a1555-d524-4919-852e-4460d97fd4b5','2017-03-25 02:17:07','2017-03-25 02:17:07','3c7eb6bc-a146-4186-bfbf-9de857286e68','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Beautiful views, good value for the rent.'),('8a824a23-cf8d-4eb2-b3c3-9ba3c2375a25','2017-03-25 02:17:07','2017-03-25 02:17:07','0a454f9a-eaac-488b-8443-23cf58f7ae37','b6160096-c503-4909-a674-7bfbddc8cc45','This place was just the perfect place for my last days. 5 minutes away from the beach and a nice hour costal-drive away from the stunning north shore. Pam sets up everything really lovely. Even if she couldn\'t be there when I arrived - everything was waiting for me: like a bottle of water, local macadamia nuts, and a list of things to know and do.<BR />The room by the way is just so cute - the nicest one I had on Hawaii so far. And so I even had the best days of sleep here. And I really appreciate Pams flexibility - my flight leaves late, so she welcomes me to stay in the common areas of here house till than. Even if we didn\'t got the chance to chat that much - thank you so much Pam! '),('8bb0c147-321d-487a-bca3-7e59ea267dc6','2017-03-25 02:17:07','2017-03-25 02:17:07','9247dcc1-711a-4ab2-b99a-f2808627d2f2','85651506-c13c-4c2f-9c79-8fbebc048e39','Amazing stay - if you\'re in town don\'t bother with a hotel. Amazing chef-prepared breakfast (beyond expectations), local tips, stories, history, music, cocktails, etc. Rooms were authentic to the period (antique furnishing) but Very clean. <BR /><BR />Price seemed low for everything included - if just a room I\'d say it\'s spot on. Toss in all the extras, I\'d say this place might run all the hotels in the area out of business. This place absolutely made our stay in Layfayette!<BR /><BR />'),('8bd71aa4-5307-4c4b-b6ef-f88e1fb83ceb','2017-03-25 02:17:07','2017-03-25 02:17:07','b6ea25aa-f298-4f24-bc8c-526439f254d5','00a11245-12fa-436e-9ccc-967417f8c30a','Affordable and friendly accommodating hosts. Never met the host because I came in from my drive so late and had to leave so early. signage around the house made everything easy to understand/find, free WiFi! Room was clean, house was inviting and pleasant, bed was probably the most comfortable thing I\'ve slept on in years. 5/5 if youre traveling through Chicago and need a place to stay the night, would absolutely recommend.'),('8be03683-7249-4766-b476-09e968478faa','2017-03-25 02:17:07','2017-03-25 02:17:07','9684e0c7-0f21-4a00-9334-1a974e13dbc3','d622edfa-fc35-4732-b5ec-a15d794267ec','Having never stayed in an Airstream before, I wasn\'t quite sure what to expect...Jason could not have been more communicative and helpful. The stay was a pleasure. The Airstream was both cozy and surprisingly spacious. It was very comfortable and there were several restaurants and things to do within walking distance. It was also great to just sit out on the deck and relax. I\'ll definitely be looking for an excuse to return as soon as possible. '),('8c1ec920-451b-4606-8c99-3f72105070a6','2017-03-25 02:17:07','2017-03-25 02:17:07','ffcc9c22-759e-4418-b788-81eda89c2865','9eec6c06-5918-4867-833a-face490d4715','Very good location. Place is cozy and tidy. Katie and Matthijs are very cool and hospitable people. Will stay again!!'),('8c3e2273-76fe-428f-a875-e3b94b0a537c','2017-03-25 02:17:07','2017-03-25 02:17:07','aaf389be-c794-4fb4-a6cf-619ca956898f','91e27a07-1f47-43c9-b851-60c6882abcd3','Wow! The place is well located, clean and well stocked. It was a nice haven! Also, Melanie is a gracious host. Looking forward to returning!'),('8cc4ed94-252