t night and pretty stars too. We\'ll totally go back.'),('8fc3809b-7d27-44be-9a8c-ece6526f2064','2017-03-25 02:17:07','2017-03-25 02:17:07','b2c8a4cd-6e80-48c3-a1fc-07f129ee2875','f9b11370-f316-492c-92da-014d7bce7213','The house is beautifully decorated, super clean. Very convenient location wise. Absolutely loved every moment of my trip to Birmingham because of this Airbnb experience. <BR />'),('900225c3-87a4-496d-93db-245db3342808','2017-03-25 02:17:07','2017-03-25 02:17:07','e551a4a6-7701-41de-be62-aae869888c78','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Clean, excellent amenities and plenty of \"extras\": snacks, lotions, toiletries. Highly recommended! '),('90acde0e-9783-4b14-b7b6-1b5e6c70e290','2017-03-25 02:17:07','2017-03-25 02:17:07','84f6227b-6c97-47ff-9ede-d4fbf4994d23','00a11245-12fa-436e-9ccc-967417f8c30a','We loved it!'),('90d85c99-7569-4cce-a9e6-4d63a53a761d','2017-03-25 02:17:07','2017-03-25 02:17:07','aaf389be-c794-4fb4-a6cf-619ca956898f','7771bbe9-92ab-46d1-a636-864526361d7d','My boyfriend and I stayed here two nights and could not have had a more positive experience! The cottage is quaint and cozy, everything is updated and a perfect space for two. We were very impressed with the small details in the cottage such as a welcome basket with treats and a sweet note, a plethora of fresh towels, updated amenities, and a list of recommendations in the area. We arrived later in the evening - Easy check in was a breeze! The location is great and within a quick distance to the Plaza, Glen Ellen, and only 40 minutes to Napa. We had no issues, but Melanie was just a quick text away. We had such a great experience and will definitely be back. Thank you Melanie for the wonderful getaway in wine country!!'),('910e4fdd-580a-4dab-9547-7b532f5e5f47','2017-03-25 02:17:07','2017-03-25 02:17:07','89ddd0bc-2250-4094-8f6d-59b35c0f6891','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','This is a gem of a place.  Location is perfect!  A secret stair path to old town shops and yet just far enough away from any late night tourism noise.  Beds are super comfy.  Jen is an exemplary host.  I would not hesitate to stay here again!'),('912ed230-3f64-4e40-9992-04854c14c81c','2017-03-25 02:17:07','2017-03-25 02:17:07','89ddd0bc-2250-4094-8f6d-59b35c0f6891','f9b11370-f316-492c-92da-014d7bce7213','Jennifer was an exceptional host and our stay was so good we did not want to leave! We would recommend it strongly to anyone who is visiting Bisbee. We loved it so much we hope to stay again when we come back!'),('9262023f-1756-4699-b758-a12be1184fb5','2017-03-25 02:17:07','2017-03-25 02:17:07','bb86e624-9ecb-4aca-a713-8cd6984f25a0','70b18dcc-08ef-4040-91cf-4075973d320a','Lovely private accommodations with kitchenette features, lovely bohemian decor, and close to Sonoma wineries. I was able to uber around vineyards instead of paying for a wine tour which was great! '),('9291db19-fc25-4dce-9245-ec7c8487d5d0','2017-03-25 02:17:07','2017-03-25 02:17:07','6a78ec0c-8410-4cbf-a915-e697a3aa798d','85651506-c13c-4c2f-9c79-8fbebc048e39','I was only there for one night but what a great place! '),('9304b57b-4a1f-4607-b061-a927edf799f4','2017-03-25 02:17:07','2017-03-25 02:17:07','b7a46879-c82a-46d9-9ea9-43cbefca2f81','91e27a07-1f47-43c9-b851-60c6882abcd3','Cozy Cottage. Great place for any traveler to stay. '),('93a773e4-3a0b-465a-9b90-7c6889f6b0c6','2017-03-25 02:17:07','2017-03-25 02:17:07','df2548db-377d-422e-b805-4e8e0c794302','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','I have only Airbnb\'d a few times, but this stay was INCREDIBLE. Kevin was a most gracious host, and an absolute pleasure to get to know. Our arrival was in the wee hours of the morning, but he woke up early and let us in to get settled without complaint. In our time there we were able to hang out with him a fair amount, and he was very helpful in guiding us around Birmingham. He also provided us with coffee and breakfast, which was a super kind gesture. The space was immaculate, from the beds to the bathroom. Impeccably renovated, decorated, and cleaned. Should we make our way back to Birmingham, we will ABSOLUTELY be staying with Kevin, and his sweet little dog Remy!'),('93fba918-fd6c-4e2e-9dc1-4c41709e3c90','2017-03-25 02:17:07','2017-03-25 02:17:07','a16c7358-bf66-4802-8933-1616b5a322db','426624f6-84a9-4ec4-84f3-7655dc70e86e','Very much enjoyed this cute spot.  Nicely appointed, clean tidy feel.  Highly recommend '),('94a92bd6-8f1f-4cbb-af83-364ed6f441b9','2017-03-25 02:17:07','2017-03-25 02:17:07','52cc10db-af9b-499c-aa8e-670056611a7c','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','If you want plenty of dining options nearby, this is your place!  State street in Fondren has  a great food option for every taste. Met Kelly in person and she\'s great.  Thanks Kelly! '),('9520fa62-6eb4-4220-b3c3-d7b2244fb22a','2017-03-25 02:17:07','2017-03-25 02:17:07','e990e07f-1b6f-4bc5-a553-ddddad30211b','7771bbe9-92ab-46d1-a636-864526361d7d','Great home and host! The porch is absolutely wonderful with a great view of downtown Birmingham at night. On a quiet street. Would definitely recommend! '),('95250535-dcde-48bb-a12f-848df205333f','2017-03-25 02:17:07','2017-03-25 02:17:07','daa15c1b-9ca6-4042-85fd-bdb7a46d5862','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Mike\'s apartment is great! Very clean and comfortable! Great location within walking distance to lots of fun bars and restaurants. We had so much fun, would definitely recommend his place to anyone going to St. Paul!'),('95508e12-2253-4150-9cd5-4261ad56fe0f','2017-03-25 02:17:07','2017-03-25 02:17:07','89ddd0bc-2250-4094-8f6d-59b35c0f6891','30a890e4-a62c-44f9-abc0-07e2c74021da','A wonderful experience. Plenty of room for two couples and a baby. Easy walking to restaurants, shops, and landmarks of Old Bisbee. Jen was a wonderful host, and even brought over some of her daughter\'s toys for my daughter to play with when we were there.  We\'ll certainly be back.'),('9591cafb-932a-4bda-b8b9-fd0792cc355c','2017-03-25 02:17:07','2017-03-25 02:17:07','d3fc84bb-8ccd-4457-99a8-91dda88dc64d','30a890e4-a62c-44f9-abc0-07e2c74021da','Good location, excellent price. Good deal'),('95935cb0-1d07-45d3-93ed-c66b86744635','2017-03-25 02:17:07','2017-03-25 02:17:07','610ef600-53da-4e05-aaaf-b7ae4d14fcfb','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Loved the location on Grand Ave.'),('95c15541-bd96-4ab1-9deb-94b05efbcb7c','2017-03-25 02:17:07','2017-03-25 02:17:07','dce54621-9083-4cd9-9335-a9e8861289d8','150e591e-486b-48ee-be42-4aecba665020','Perfect crash-pad for a trip to SF. This place is walking distance from just everything, and the restaurant and cafe on the bottom floor are superb.'),('95dd6a92-88c4-4d6c-8b8d-860656b937e2','2017-03-25 02:17:07','2017-03-25 02:17:07','ad124633-a610-483f-862a-6f54dda19c6e','91e27a07-1f47-43c9-b851-60c6882abcd3','Lida was a nice host. <BR />It\'s a cheap place, but it\'s not the biggest one.<BR />'),('961cc8cc-2b68-4c03-8288-cd51775dfc1a','2017-03-25 02:17:07','2017-03-25 02:17:07','817bcb43-ba39-4925-aed6-76be4bed946b','00a11245-12fa-436e-9ccc-967417f8c30a','JJ\'s brother, Tom, was a great host. He made our stay at this Bnb very pleasant. Only issue was parking, which was a bit difficult to find, and we had to park a couple of blocks away from the house'),('963dea2d-abae-47f3-a177-fda7407b8179','2017-03-25 02:17:07','2017-03-25 02:17:07','552b5aaf-33b7-407b-a2dc-459ab730b3a5','df668e22-e344-4c89-a050-e5ad211cbaa6','Annie is a great host and the place is brand new. Centrally located and walking distance to a lot of great restaurants and stores. Parkings can be troublesome at times but that\'s similar in any city setting. '),('96a07a1f-d437-4398-9a31-36241379b972','2017-03-25 02:17:07','2017-03-25 02:17:07','66fb8e5d-2ad2-44be-8890-a13a9992f257','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','My husband and I travelled to Portland for the first time and Naomi\'s house was absolutely wonderful in every way. Located in Beaverton, just a short drive from downtown and the airport, it was a quiet escape nestled on the end of the street in a nice neighborhood. We rented a car, so the drive downtown was super quick and easy but there is public transit as well. The house itself was perfect for us because we like to cook, so the kitchen had everything (and more) that we needed to whip up a meal. There are tons of games and cards to play during a fun night in front of the cozy fireplace. Also, the bed was the most comfortable we\'ve ever slept on, even more than our bed back home. It\'s not often you stay in an airbnb and think, \'gosh, I wish this were my home.\' We would highly recommend Naomi\'s place to anyone looking for a cozy getaway in a beautiful city.'),('97218304-bb8e-40c0-812c-d264180b2407','2017-03-25 02:17:07','2017-03-25 02:17:07','e6c33577-5de3-4481-9147-47ef4710b986','7771bbe9-92ab-46d1-a636-864526361d7d','Joanna and her family are great hosts! We had a very warm welcome and a super stay at their house. We are happy to be back soon! Thank you!'),('9744f05e-c04b-4578-9941-8af259b2b9f6','2017-03-25 02:17:07','2017-03-25 02:17:07','610ef600-53da-4e05-aaaf-b7ae4d14fcfb','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Lauren\'s place is the perfect little apartment for a nice get away in St. Paul! 10/10 would recommend. Thanks for everything! '),('979cd355-c3a2-41c3-adc2-c3cca6c9e29d','2017-03-25 02:17:07','2017-03-25 02:17:07','bb86e624-9ecb-4aca-a713-8cd6984f25a0','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Very quiet and easy to get to vineyards'),('9825ef7d-252e-4c2d-a511-8f315cd13206','2017-03-25 02:17:07','2017-03-25 02:17:07','df2548db-377d-422e-b805-4e8e0c794302','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Kevin was a thoughtful and good host. The room and apartment were very nice and clean! The room is subject to the weather temp, so keep this in mind if visiting during cold or hot seasons! '),('98328190-4428-473a-9cd2-5269a040f4ad','2017-03-25 02:17:07','2017-03-25 02:17:07','6d24beec-f296-473c-a34a-4dd9aab8a780','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Great location and comfortable digs! '),('98395e5f-654e-4eb0-881e-e4ed73073304','2017-03-25 02:17:07','2017-03-25 02:17:07','b6692019-ac4a-47aa-a671-89cd79c9e11f','fa44780d-ac48-41ab-9dd0-ac54a15755cf','Mason was easy to reach and friendly. Our checkin process was very easy. The apartment itself is not near a lot, but it was a short Lyft to downtown where there were lots of bars and restaurants to check out. The apartment has everything you need, was comfortable clean and ready for us. I would recommend staying here, especially if you\'re going to see a concert at Syndicate Lounge like we were! '),('9853d6c7-6875-4f74-ac6b-628ac114c281','2017-03-25 02:17:07','2017-03-25 02:17:07','328bd785-a91b-424c-afda-9e08e5155cfe','f9b11370-f316-492c-92da-014d7bce7213','Bryan was a very nice host and the stay was good. Downtown is a short drive away and you get a lot of recommendations for food.'),('98ca6ce3-e98d-4d66-a1d7-3aaca65694a0','2017-03-25 02:17:07','2017-03-25 02:17:07','b6692019-ac4a-47aa-a671-89cd79c9e11f','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','Mason\'s listing was completely accurate. Great place to crash for a night and you cant beat his rate. '),('991e0172-0884-4ba6-a952-aa512c29c339','2017-03-25 02:17:07','2017-03-25 02:17:07','bc227cc3-0ad7-4b9a-b72a-6c2a45e6a88a','00a11245-12fa-436e-9ccc-967417f8c30a','The hospitality was great. They let us checkin a few hours early because no one stayed there the previous night. Special thanks to them for that. The house is beautiful. The location is safe. We rented the house for 3 nights for a reunion and it was so much fun. Everyone loved the house. I would recommend this to anyone who is looking to rent a house in the suburb. '),('995bfb29-056d-4f8b-983d-7efbcf10a853','2017-03-25 02:17:07','2017-03-25 02:17:07','1ff1963c-7afa-470c-bc05-562b01549b09','9eec6c06-5918-4867-833a-face490d4715','Favorite BNB so far :) very comfy, super cute, good location, great host, can keep going on.... would definately recommend for a girls\' trip 