e car, and another friend made me a nice beverage. I felt very welcomed. <BR /><BR />I enjoyed the comfort of the bed and I guess we got lucky and booked on a weekend where we were the only guests, which was great for us because we did not have to share the bathroom with any other guests.<BR /><BR /> I would stay again.'),('9b46cba5-61b2-401e-aec9-1d1fe039d5c8','2017-03-25 02:17:07','2017-03-25 02:17:07','b13b1a74-3a12-4f00-8c19-273cbedc0eaa','df668e22-e344-4c89-a050-e5ad211cbaa6','Great Place.  Great Location.  Loved the patio for morning coffee.  Very well equipped'),('9b494e60-758f-4a85-803b-759bf694adc8','2017-03-25 02:17:07','2017-03-25 02:17:07','645127dd-38b4-4fad-9950-57b3ce0a5301','85651506-c13c-4c2f-9c79-8fbebc048e39','Not bad for a quick in and out stay. I was unaware before I got to the house that the only parking options were to take a chance on a parking ticket or park 3 blocks down in the cold and walk back (don\'t forget anything), I took a chance on the parking ticket. The head of the bed had a decline so that your head it tilted backwards and the flat pillows did not help. To bedroom was up against the living room/bedroom and could hear much of the voices and music and feel the bass. As well the only access to the bedroom was through the dining room which the residents were using with friends around 8/9pm and were not regarding any noise concerns.  '),('9b8a6325-16cf-489f-89ef-9bd5085b8c7e','2017-03-25 02:17:07','2017-03-25 02:17:07','14e9cb05-e188-4e02-ab2c-8ef425e5ea64','426624f6-84a9-4ec4-84f3-7655dc70e86e','Donna accommodated our very last minute request for which we were grateful!  She was welcoming and very responsive.  Our room was comfortable, and the house located near a park, co-op, and coffee shops with easy access.  I recommend Donna and her home.'),('9b9138e7-188f-4b53-8f9f-9f589a5c079f','2017-03-25 02:17:07','2017-03-25 02:17:07','e74201c2-6057-419d-be22-d0087eeb4179','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','Very warm welcome. Sherry h