17:07','ad124633-a610-483f-862a-6f54dda19c6e','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','I\'ve stayed here twice.  Solid location, comfortable, friendly hosts.'),('bff75b8e-e4cf-4400-90ea-3d0ac0819058','2017-03-25 02:17:07','2017-03-25 02:17:07','8835ba11-7757-45c6-9138-f7e2e4b5f80f','df668e22-e344-4c89-a050-e5ad211cbaa6','Jordan\'s place was exactly what I was looking for in my stay in Kailua. Having a bicycle was great for getting around town.'),('c0311a61-4337-4c33-a9d9-b7a139afeb16','2017-03-25 02:17:07','2017-03-25 02:17:07','38e38612-a626-47a9-a699-05efa178e155','30a890e4-a62c-44f9-abc0-07e2c74021da',' War ok<BR />'),('c10068e3-c90e-4be8-aaf3-74756f877ed3','2017-03-25 02:17:07','2017-03-25 02:17:07','c29b5191-ac68-4e9b-a68f-aa42ea1dcb01','887dcd8d-d5ee-48de-9626-73ff4ea732fa','This place is enjoyably eclectic with the owner\'s art adorning the walls. The house was clean and the bed was comfortable. The location is close to good eating and a variety of clubs in downtown Lafayette. I was in town for a travel seminar after which I walked the few blocks to a really cool beer garden. This place is a gem!'),('c102485d-59a0-4a3d-814b-ef0335fb8e1d','2017-03-25 02:17:07','2017-03-25 02:17:07','9c7d3ecd-9592-4910-bd04-91c59e8350f1','8394fd35-8a8a-479f-a398-48f53b4a6554','Very cute cottage off of a main house in downtown Tupelo. Great location if you want to be near to the downtown and arena. '),('c13c8f6a-d86e-451a-925e-93cd7c8ed9d0','2017-03-25 02:17:07','2017-03-25 02:17:07','817bcb43-ba39-4925-aed6-76be4bed946b','f9b11370-f316-492c-92da-014d7bce7213','JJs place did the job. He\'s a great communicator and we had no issues with the reservation, finding the place or getting in. Warm and cozy room, right next to the bathroom. 10/10 would recommend.'),('c18dfc28-d7d4-48b5-a789-694fd80eefc1','2017-03-25 02:17:07','2017-03-25 02:17:07','38f1bc75-713e-4f09-b02f-d26a4c43ac63','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','It\'s always a pleasure to stay at this house.'),('c2334a6d-801b