>Some Airbnb research yielded Naomi and Franks place.  Had everything we were looking for and some we didn\'t know about.  <BR /><BR />Space for three, wi-fi, a beautiful Bisbee view.  <BR /><BR />What we didn\'t know was how great it was that it had convenient off street parking. <BR /><BR />Naomi called just minutes after our booking went through and gave us check-in information.  <BR /><BR />Frank met us at the turn in to the house and escorted us to their lovely space.  <BR /><BR />The place was just perfect.  Well furnished, spotlessly clean. Beds comfortable (with extra pillows that we appreciate).'),('c8e07ad6-da02-46a7-9d3f-cd11dee25965','2017-03-25 02:17:07','2017-03-25 02:17:07','acd9cdca-855e-484b-baf9-ffda99d945f2','7231eaa1-400f-4cb5-a867-f5eba8adbb81','The house was amazing! We arrived later than expected but I was able to get in the house with just a code. Cindy and don were very helpful and I will definitely make this trip happen again. '),('ca018781-aaa7-48e1-a03c-be521311d8c8','2017-03-25 02:17:07','2017-03-25 02:17:07','7a958fb6-a203-441c-9f8f-3440523fed14','fa44780d-ac48-41ab-9dd0-ac54a15755cf','Good location to mass transit, affordable'),('ca72c975-f4b1-4960-a331-326fc49ed42e','2017-03-25 02:17:07','2017-03-25 02:17:07','b33cae89-fe4f-4c6e-a1c5-0022450f2bf2','b6160096-c503-4909-a674-7bfbddc8cc45','Michelle\'s place was excellent. The location is in a local area without the tourist noise. The beach you have access to is perfect for watching the sunrise or a quick swim. Michelle herself is very friendly and clearly takes pride in being an Airbnb host. Lots of little extras are available in the space (water, snacks coal for the BBQ etc), we really enjoyed the banana pancake mix provided :)<BR /><BR />So glad we stayed and got to experience a quiet local neighborhood! Highly recommended!'),('cb4b40c3-b6bc-44d8-8331-c9a3d7c7a77c','2017-03-25 02:17:07','2017-03-25 02:17:07','be13aa0e-8da7-4943-be05-5fd89f4d18e6','7771bbe9-92ab-46d1-a636-864526361d7d',