0a454f9a-eaac-488b-8443-23cf58f7ae37','70b18dcc-08ef-4040-91cf-4075973d320a','Lovely place very nearby the beautiful beach.'),('db48fa91-4e03-4eb1-858a-c4fd95f8f76c','2017-03-25 02:17:07','2017-03-25 02:17:07','12ff7d06-9910-41cd-9eee-bdc21476d119','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','This condo is comfortable and clean in an excellent location. The beach is just a short walk away, so are the major shopping centres and restaurants. Dana was helpful in getting us checked in and settled.'),('db4b819d-3611-4914-b0c8-5b9a6f6eb978','2017-03-25 02:17:07','2017-03-25 02:17:07','7a958fb6-a203-441c-9f8f-3440523fed14','fa44780d-ac48-41ab-9dd0-ac54a15755cf','Great place to stay! A simple, but clean and very nice apartment with most everything you could ask for. The host Fabian is very good about staying in touch or answering any questions you have and is an all round pleasant person to talk to. May be hard to find parking later in the day.'),('dcb24c1c-905f-45d1-8d65-7929d8acffaa','2017-03-25 02:17:07','2017-03-25 02:17:07','4ae40c33-23c9-47a9-b867-0a6d8f25fd8c','8394fd35-8a8a-479f-a398-48f53b4a6554','Barb is a fantastic communicator! With her clear guidance, we were able to check in comfortably.  The views are spectacular.  Just as a heads up, the bathroom does not close completely and the shower head is low.  For me it was fine, but difficult for my taller friend to shower comfortably.  '),('dcbf7676-46fc-4261-8f24-99202312bd9d','2017-03-25 02:17:07','2017-03-25 02:17:07','d37d7e5a-d186-45a0-a190-c065ff5922e8','00a11245-12fa-436e-9ccc-967417f8c30a','Wow, where to begin.....First of all, we had an wonderful stay at a spot - on place to stay. I am pretty picky and realistic when it comes to experiences like this and I can say with sincere conviction that I felt as if this was a custom-made house stay for me, my wife and our beloved pooch. The house is funky, upbeat, colorful as advertised in a unique town in a unique spot accessible to all that we desired. Surprisingly quiet, tranquil, a genuinely friendly neighbor Linda, we loved the fenced in front and back yards for our dog (he is very picky too and seemed at home immediately!). The bed was comfy, the shower nice and hot (important for me!), after all our adventures we were able to relax in the living room as if it was our own and watch an obscure movie on Netflix, great wifi, great cell phone reception (who would think in the middle of a copper mine??). We didn\'t do any cooking, but were tempted by the gas stove, and did enjoy the comfort of fresh ground coffee because how did t'),('dcc77ae5-fb82-4314-bc4b-3db267bd5ac6','2017-03-25 02:17:07','2017-03-25 02:17:07','daa15c1b-9ca6-4042-85fd-bdb7a46d5862','f33e2624-520b-4bc2-b6a0-190ee1d41855','Mike\'s place was perfect for our short trip to the cities. Clean, comfortable, and the perfect distance to restaurants and the Xcel Energy Center!'),('dd4f2ff1-1385-4fec-8d32-f0b11d85bb49','2017-03-25 02:17:07','2017-03-25 02:17:07','43803445-1874-4a3c-94e9-955fcb25089b','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','This place is so cozy and we\'ll decorated. Valerie and Spencer were both very freindly and informative. We really enjoyed our stay. '),('dd8967a1-4517-44ab-9991-a49b9ed9d7bd','2017-03-25 02:17:07','2017-03-25 02:17:07','9c7d3ecd-9592-4910-bd04-91c59e8350f1','887dcd8d-d5ee-48de-9626-73ff4ea732fa','Chris was super helpful with the house and extremely gracious about our privacy.  The listing was as advertised, and it was extremely close to down-town Tupelo, making it easy to walk to dinner and stroll around.  We loved it!'),('ddf248ee-62f0-4bda-ae0c-1bfff7ddc4a4','2017-03-25 02:17:07','2017-03-25 02:17:07','e2d4feeb-4cb0-4df4-a10e-5a54748621b3','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Lovely refurbished Tudor style home.  Very welcoming and inclusive hosts.  The breakfast was all homemade and fabulous.  This was a great place to stay.'),('de9be2f6-a40e-4419-b321-f49711f8d155','2017-03-25 02:17:07','2017-03-25 02:17:07','78ca76e7-78dc-4867-