 of, we just settled in and enjoyed our weekend. If you prefer a qui'),('e0770c00-988d-4c04-9b7c-5ec68fd704aa','2017-03-25 02:17:07','2017-03-25 02:17:07','32945f6e-5a96-4233-b8ae-048d51323d7b','887dcd8d-d5ee-48de-9626-73ff4ea732fa','The hotel outside looks a little older, the room was cute, though.  Had great shower pressure, AC worked wonderfully, room was clean, and had all the toiletries.  Beds were also very comfortable. '),('e0c8454d-591f-4365-af19-a76c4d2f6b9e','2017-03-25 02:17:07','2017-03-25 02:17:07','859a8a8f-9423-4bf6-b471-d9a7f39c9c2c','8394fd35-8a8a-479f-a398-48f53b4a6554','The pool house was a very nice place to stay. Brent and Cindy are very accommodating. Highly recommended!'),('e2baf0b9-3bc9-4525-8616-323d01178256','2017-03-25 02:17:07','2017-03-25 02:17:07','aaf389be-c794-4fb4-a6cf-619ca956898f','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','The cottage was beautiful and was stocked with everything anyone could possibly need for a comfortable stay. The neighborhood was quiet and away from busy streets and at the same time a conveniently short distance from many great restaurants, markets, and wineries. This is a great place to stay if you are traveling solo or with a significant other; the cottage is very intimate.'),('e327d2a5-651c-4ba8-8dea-2098483e481d','2017-03-25 02:17:07','2017-03-25 02:17:07','df2548db-377d-422e-b805-4e8e0c794302','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','Very nice. Such a cute place to stay. Kevin was great! Was quite and has a beautiful view of the city at night. We loved it. '),('e32a3a30-4565-4628-8d9f-6def81f7f97c','2017-03-25 02:17:07','2017-03-25 02:17:07','e979e012-bcb1-47ea-bb39-140cdfe0f917','30a890e4-a62c-44f9-abc0-07e2c74021da','Clean and comfortable! '),('e3552d9e-a604-462d-98c2-3b1b84411efa','2017-03-25 02:17:07','2017-03-25 02:17:07','b4a927e4-9715-4cd2-9918-47491f97df3e','61302be9-4b31-4be0-92fc-d0dda253e167','Great place and great people!  '),('e3fbbb5f-e399-4b2f-afa5-7ec6bf9040c3','2017-03-25 02:17:07','2017-03-25 02:17:07','ef3f56b8-c024-471e-b7ba-be1a72c6cbec','00a11245-12fa-436e-9ccc-967417f8c30a','Good place to stay for a night or two. 4 minute drive from downtown Tempe. '),('e44002aa-aec6-4409-ac16-056e32f2e7b6','2017-03-25 02:17:07','2017-03-25 02:17:07','d27f17eb-3ddd-44c0-9e8a-f3c21d933b3b','fa44780d-ac48-41ab-9dd0-ac54a15755cf','I communicated with Sandra throughout my trip and was very flexible by the fact that I wasn\'t sure exactly what time I would be reaching because I was doing a road trip. The room is clean and the bathroom is very nice! The host also provides netflix in the living room!'),('e50771ef-090e-4ca0-8771-db5eb18ad3fc','2017-03-25 02:17:07','2017-03-25 02:17:07','47b9ca37-915d-405d-861d-7dbf74559441','fa44780d-ac48-41ab-9dd0-ac54a15755cf','The hot tub is awesome. Take note that there\'s no place to prepare food, but there is a small fridge (think of this as a hotel room). Check in is very simple. '),('e5384b00-9cd1-436a-92b9-3d2a6dedddea','2017-03-25 02:17:07','2017-03-25 02:17:07','279b355e-ff9a-4b85-8114-6db7ad2a4cd2','150e591e-486b-48ee-be42-4aecba665020','Great place! Nice and clean and super comfy linens. Would recommend!'),('e55b4562-17db-4f65-8c66-9f41e9f32137','2017-03-25 02:17:07','2017-03-25 02:17:07','e3f28357-a476-4032-8726-4ac7262cbc72','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','I had an excellent stay at Jane\'s while in Napa on business. It\'s centrally located and just a five minute drive from some great food and stores. The house is a lovely place and the room was one of the best Air BnB experiences I\'ve had yet - she thought of everything one may need during a stay. I highly recommend!'),('e5be7970-868c-47e9-9ffd-6c0b32590470','2017-03-25 02:17:07','2017-03-25 02:17:07','6a78ec0c-8410-4cbf-a915-e697a3aa798d','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','Will definitely come back here when in the area! Fantastic place, highly recommended! Don\'t forget your swimsuit - great pool, lake and jacuzzi. Very private and beautiful gardens.'),('e5c