or our visit to Napa/Sonoma. As others have commented, it is cozy but very well-appointed with everything you could possibly need for a lovely stay. Bed was very comfortable. Melanie greeted us warmly with a smile and a hug and was very responsive to any inquiries we had.  The location was perfect for our jaunts to Napa for the wine train and a day trip to Calistoga. This is the epitome of an AirBnB stay......'),('e7f4c843-1952-4d7d-ac87-866bedeb2bbb','2017-03-25 02:17:07','2017-03-25 02:17:07','b13b1a74-3a12-4f00-8c19-273cbedc0eaa','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Very nice place,  but just couple notes-pretty serious stairclimb, good workout though! Smells smokey, smoker friendly. That\'s the main thing our group didn\'t care for. Other than that, nice place, well appointed. Great location and view, not loud. '),('e8146cd3-2224-40d3-874e-94216e106514','2017-03-25 02:17:07','2017-03-25 02:17:07','e979e012-bcb1-47ea-bb39-140cdfe0f917','91e27a07-1f47-43c9-b851-60c6882abcd3','Great host.  Clean and super friendly.  Fun dog to love on.  Very thoughtful host.'),('e8450beb-0727-4148-b9f9-a7460e2531c6','2017-03-25 02:17:07','2017-03-25 02:17:07','6ebec357-8589-435b-a5cb-fcd99b638fae','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','Elisa was kind and communicative. She left breakfast out which was an amazing detail! Also, Elisa has the most amazing pillows in the room! Highly recommend!'),('e84e4ec9-64ec-4512-a27d-a7b590ada6ee','2017-03-25 02:17:07','2017-03-25 02:17:07','6ebec357-8589-435b-a5cb-fcd99b638fae','150e591e-486b-48ee-be42-4aecba665020','Staying at Elisa\'s house was amazing! The large room and super comfortable bed made our big drive easy to recover from. <BR /><BR />The coffee and scones in the morning was a great bonus too! Thanks for a good stay!'),('e88b2d64-c23d-4c1b-9776-211ab7235c91','2017-03-25 02:17:07','2017-03-25 02:17:07','18ff54e2-dc10-4e7f-bfdb-8a7591f7f009','61302be9-4b31-4be0-92fc-d0dda253e167','There are two other rooms that get rented out so the share places feels a little untidy sometimes. But the room itself was clean and was fine. The house is on a busy street so there is a bit of traffic noise. It was nice being able to use a washer and dryer and a kitchen too. Travis was nice and checked whenever he did see us if things were fine. '),('e914faa0-1813-4e47-82f1-2d6377938027','2017-03-25 02:17:07','2017-03-25 02:17:07','eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba','150e591e-486b-48ee-be42-4aecba665020','Great place! '),('e93ec66a-f5d6-47bd-8a43-f7568ffdf026','2017-03-25 02:17:07','2017-03-25 02:17:07','98b1678d-d25c-476a-b6c3-c11978617e90','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','Chris was very welcoming and easy-going. The room was clean and comfortable. Would definitely recommend! '),('e99c015a-780a-463c-9bab-3efadb2e80a2','2017-03-25 02:17:07','2017-03-25 02:17:07','12ff7d06-9910-41cd-9eee-bdc21476d119','426624f6-84a9-4ec4-84f3-7655dc70e86e','This place is all about location. Its minutes from the beach and a short walk to Waikiki or Ft DeRussy beach, or easy bus ride to further sights (e.g., Iolani Palace, Diamonds Head).  As a bachelor suite, the room itself was the perfect size for a couple looking to explore Honolulu. Inside, the dcor is pretty and modern and makes a nice private place to relax after a long day of adventure.  Though we didn\'t get a chance to use the pool (we were too busy exploring Honolulu), it looked well maintained and like a great place to relax.  Outside, the building itself, which is both a hotel and condo buildling, is a bit dated. However, the staff are very friendly, and someone is always around  night or day - to help you in case your key card doesnt work.  Dana was also a great host, and communication with her was quick and easy!   '),('ea71f26f-3e10-460f-a7c7-587448c1fb52','2017-03-25 02:17:07','2017-03-25 02:17:07','d991f849-0f2f-41cb-b6d7-41feee6bc943','91e27a07-1f47-43c9-b851-60c6882abcd3','It was our first time booking a room in a shared home and it was a great experience.  The family was nice and generous.  The street parking was full so they offered their garage.  If I needed to go back to Fremont, I would book it again.'),('ea8b5ac8-c518-4ac3-aca2-b73a9d774f20','2017-03-25 02:17:07','2017-03-25 02:17:07','78ca76e7-78dc-4867-8281-50ab3dc47cdd','f33e2624-520b-4bc2-b6a0-190ee1d41855','Small and relaxing. Cozy and comforting.'),('ead4adc8-07ed-492e-8fed-a6421cce171e','2017-03-25 02:17:07','2017-03-25 02:17:07','328bd785-a91b-424c-afda-9e08e5155cfe','cf1780e6-d294-4113-8749-1c728b9e3f81','Old house that is remodeled. Nice bedroom with comfortable bed. We enjoyed our stay. '),('eb78caf9-de6a-4a18-8961-52bec8c4c320','2017-03-25 02:17:07','2017-03-25 02:17:07','836bea96-c22d-46d2-9335-b97cec4cc30a','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Ellen is a super hostesses. All the southern charm of Jackson with great art and atmosphere. Comfortable home in the heart of Jackson.'),('eb7a2c08-d5b5-47f4-8f6b-58b9105dc94e','2017-03-25 02:17:07','2017-03-25 02:17:07','52cc10db-af9b-499c-aa8e-670056611a7c','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Kelly\'s place was very affordable, and was exactly as advertised! '),('ec2750e9-9b0a-49d9-b2ef-77898aded427','2017-03-25 02:17:07','2017-03-25 02:17:07','817bcb43-ba39-4925-aed6-76be4bed946b','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','JJ is easy to get in touch with and offers a quiet place to sleep and take a shower. The lava lamp really lives up to the hype.'),('ec299be8-75d4-4dee-a4f7-ce30dc7409a6','2017-03-25 02:17:07','2017-03-25 02:17:07','ad4cd1fe-3358-4183-8062-59e39824175c','3fda0d5c-fea4-4920-bc91-6e6c6663d161','An absolute perfect step back into time. '),('ec3be7c6-867e-4863-acc9-aecacb272fd3','2017-03-25 02:17:07','2017-03-25 02:17:07','7354ea6c-3c0e-4800-aad8-708c29a6c067','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Not very clean, but it is a good value. Tex was very accommodating to our early check-in and late check-out, which we really appreciated. '),('ed4dade8-cd64-4525-8687-9cf2bf9af980','2017-03-