ere next time I\'m in Denver!'),('f17cd286-e5e1-4b88-9e0a-b364e445f474','2017-03-25 02:17:07','2017-03-25 02:17:07','b180ad52-fe00-4040-97f9-9efdfc3d406d','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Had a wonderful cozy time in the pod as my base to explore a bit of eugene. Very nice hosts, I\'ll definitely be back again next time I come to Eugene.'),('f26121a1-2230-43b5-8139-10254cc592ea','2017-03-25 02:17:07','2017-03-25 02:17:07','ae787938-171f-4563-8c75-92a037fed415','fa44780d-ac48-41ab-9dd0-ac54a15755cf','I enjoyed 3rd time stay over there.'),('f3130aa5-0eb8-40ef-9916-395097c2db71','2017-03-25 02:17:07','2017-03-25 02:17:07','3c7eb6bc-a146-4186-bfbf-9de857286e68','fa44780d-ac48-41ab-9dd0-ac54a15755cf','This is an extraordinary space with sweeping views and a lovely front and back patio for sipping wine and enjoying the stars.  Naomi and Frank have thought of almost everything to make your stay seamless and fabulous.  Best place we have stayed in Bisbee.  Highly recommend.  '),('f38b227e-2c78-41af-a6da-383fcb8b02bc','2017-03-25 02:17:07','2017-03-25 02:17:07','31568a3f-d5b1-47d1-b2ee-74339059e3a0','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Fantastically clean and cozy. A great place to stay if you are looking for peace and quiet! '),('f471f8dd-f80d-4c30-8148-1d06c82d95f2','2017-03-25 02:17:07','2017-03-25 02:17:07','ff46f903-411b-4a16-8e16-1aab7f00686c','9eec6c06-5918-4867-833a-face490d4715','Tiffany and Ryan\'s place was clean and comfortable and close to the center of Bisbee. A good place to stay!'),('f4c6b375-490f-40c9-aead-82f0bc2dfafe','2017-03-25 02:17:07','2017-03-25 02:17:07','96233d68-319e-4ae0-a20f-3af55dcadb0a','df668e22-e344-4c89-a050-e5ad211cbaa6','Just wanted to add that check-in and check-out is very much as you would as a guest of Hilton Conrad. Easy-peasy and a great value. Thanks!'),('f56c6dce-e118-4edd-bb15-1a0f363e2a78','2017-03-25 02:17:07','2017-03-25 02:17:07','328bd785-a91b-424c-afda-9e08e5155cfe','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','I had a 