3-25 02:17:07','2017-03-25 02:17:07','60b77ea7-04c9-4b8a-b835-dc92c6aa196b','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','This was a great location but definitely cozy. Small bathroom but very clean. The hosts were also great. Very communicative and helpful. '),('fb978264-d7a8-4f39-b336-5430e35ff851','2017-03-25 02:17:07','2017-03-25 02:17:07','43803445-1874-4a3c-94e9-955fcb25089b','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','I only stayed one night but it was amazing! It\'s a beautiful house in a beautiful street. The room is spacious and has everything you might need. Bed is super comfy! The bathroom was very clean and right next to the bedroom. Plus Valery and Spencer are super nice. Totally recomend it.'),('fbec97dc-a67a-474c-ad2b-13941c2974f5','2017-03-25 02:17:07','2017-03-25 02:17:07','19ae5055-f503-499d-a64f-2bf7d92eff5b','91e27a07-1f47-43c9-b851-60c6882abcd3','Great place, no issues. 10/10'),('fc37a5ba-05c4-4b89-83e3-a163b7246172','2017-03-25 02:17:07','2017-03-25 02:17:07','836bea96-c22d-46d2-9335-b97cec4cc30a','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','Beautiful home; excellent host with exceptional communication. '),('fcbb4119-5be5-4d80-8446-ccd579fcf86c','2017-03-25 02:17:07','2017-03-25 02:17:07','9247dcc1-711a-4ab2-b99a-f2808627d2f2','887dcd8d-d5ee-48de-9626-73ff4ea732fa','We had a fantastic one night stay at Plantation Mouton Bois Des Chenes enroute to New Orleans. We stayed in the Carriage House which was clean, comfy and had good WiFi. Ravi greeted us with wine and delicious cookies fresh out of the oven and John cooked us up a stellar breakfast feast the next day (fruit salad, crab omelette, jalapeno sausage and biscuits). Loved having a tour of the house and getting John\'s run down on the area. Highly recommended (don\'t forget to get the breakfast)!'),('fcd4853a-b6a5-48b5-aa14-c0832f8b0e22','2017-03-25 02:17:07','2017-03-25 02:17:07','2b6e6650-5f69-426d-a084-71f7ad30d1f1','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Beautiful home in beautiful Kailua. '),('fdc5fa63-1ce0-4d36-bf98-99b259514ed8','2017-03-25 02:17:07','2017-03-25 02:17:07','be89d2ce-231e-4205-a8c1-e6bcf5990302','7231eaa1-400f-4cb5-a867-f5eba8adbb81','We had a perfect stay here. Great value and a home-y feel. Sequoia also made us delicious smoothies for breakfast. Highly recommended. '),('fe1361da-3b8a-407f-aad8-e7f6f0de3cc4','2017-03-25 02:17:07','2017-03-25 02:17:07','a302bce0-cb8e-4e54-ba2b-0822b0565303','85651506-c13c-4c2f-9c79-8fbebc048e39','Bill is a great host and I had a wonderful time there, he was incredibly helpful and except for my bad back on the futon it would have been perfect but other than that it was good!'),('fe389bf0-dba8-4343-81be-1b718b10b675','2017-03-25 02:17:07','2017-03-25 02:17:07','bcda6018-7286-4d8c-abfa-dda1026adf88','9eec6c06-5918-4867-833a-face490d4715','We loved the cottage. It was clean and cute. Nice shower! Bed is comfy. Private feel. It was nice to stay outside of downtown Sonoma a bit and meet the locals. Great value!'),('fe521e87-3e45-41ee-a772-46df3840e9d5','2017-03-25 02:17:07','2017-03-25 02:17:07','ad124633-a610-483f-862a-6f54dda19c6e','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','I had a late arriving plane and Lida was very accommodating and able to have someone available to greet me when I arrived. The bedroom and bathroom are basic but towels were provided and everything was clean and comfortable. Great value!'),('fef65853-3097-4eff-8925-2ae5f29fd70b','2017-03-25 02:17:07','2017-03-25 02:17:07','9247dcc1-711a-4ab2-b99a-f2808627d2f2','df668e22-e344-4c89-a050-e5ad211cbaa6','THE BEST airbnb experience from seasoned airbnbers!  From cocktails when you check in to cajun jam sessions to historical tours of the property, John and Ravi made us feel like family immediately.  This is a true bed and breakfast and a STEAL at the price they charge! The room was charming, private, and smelled great!  Don\'t think twice about staying here because this place is an experience not to be missed when in Lafayette! Cant wait to come back!'),('fefe550f-b651-4b36-ab19-d27d6529e5a7','2017-03-25 02:17:07','2017-03-25 02:17:07','6ebec357-8589-435b-a5cb-fcd99b638fae','fa44780d-ac48-41ab-9dd0-ac54a15755cf','Elisa has a beautiful home and a great system for welcoming visitors, even if you check-in after hours like we did. We had to rush out in the morning, but Elisa was kind enough to offer us breakfast as we were leaving. The room and bathroom were very clean and the towels were super-soft. It was a little bit of a drive back to her house, but it was a nice, quiet neighborhood.'),('ff45e34c-5177-4817-8e6a-9f52cb34d06e','2017-03-25 02:17:07','2017-03-25 02:17:07','314b188e-990b-423e-ae63-f0199b8c2b17','61302be9-4b31-4be0-92fc-d0dda253e167','We had a lovely stay at this cottage in Bisbee. Everything was beautiful, clean, and exactly as pictured and described. Everything was provided including coffee pods, wine glass, a wine bottle opener, etc. All of the little details were provided and made our stay even more wonderful. The deck has a gorgeous view. We were able to walk to everything in town. We\'ll rent this place again any time we want to go back to Bisbee!'),('ff54bd47-758d-41f1-a69f-704921d2eeaf','2017-03-25 02:17:07','2017-03-25 02:17:07','47b9ca37-915d-405d-861d-7dbf74559441','426624f6-84a9-4ec4-84f3-7655dc70e86e','Carmenita is a friendly person! Her place also clean and nice!'),('ff7d29b2-1d11-4bed-8645-8ee5fc72a82e','2017-03-25 02:17:07','2017-03-25 02:17:07','89ddd0bc-2250-4094-8f6d-59b35c0f6891','150e591e-486b-48ee-be42-4aecba665020','Super comfortable and really convenient - all around a great spot! Not only was the place perfect but Jennifer was helpful with any questions/concerns. If you\'re headed to Bisbee this place is a must book.'),('ffaab65f-0491-4bbf-9b58-faad830acc73','2017-03-25 02:17:07','2017-03-25 02:17:07','3290a4ef-4241-4fa5-843e-87926c74e384','df668e22-e344-4c89-a050-e5ad211cbaa6','This was a superb catch- great value for the fee. It was the perfect place to relax. The neighborhood is beautiful and calm, and it is very easy to get around Tempe from this spot. Carlos has his hospitality game together - you would think he took a course.'),('ffec053e-cc6a-4802-8bbf-1b5d078a0c92','2017-03-25 02:17:07','2017-03-25 02:17:07','279b355e-ff9a-4b85-8114-6db7ad2a4cd2','70b18dcc-08ef-4040-91cf-4075973d320a','The location is great with mass transportation available within a short walking distance. The room is private and very cozy. Ryan was alway available for all the restaurant questions I had! ');
